(36,	'سياسة الاسترجاع',	'لوريم إيبسوم هو ببساطة نص شكلي يستخدم في صناعة الطباعة والتنضيد. كان لوريم إيبسوم الدمية القياسية في الصناعة\r\n\nالنص منذ القرن الخامس عشر الميلادي ، عندما أخذت طابعة غير معروفة لوحًا من النوع وتدافعت عليه لعمل عينة من النوع\r\n\nكتاب. لقد نجت ليس فقط خمسة قرون ، ولكن أيضًا القفزة في التنضيد الإلكتروني ، بقيت بشكل أساسي',	2,	3),
(37,	'الشروط والخدمات',	'لوريم إيبسوم هو ببساطة نص شكلي يستخدم في صناعة الطباعة والتنضيد. كان لوريم إيبسوم الدمية القياسية في الصناعة\r\n\nالنص منذ القرن الخامس عشر الميلادي ، عندما أخذت طابعة غير معروفة لوحًا من النوع وتدافعت عليه لعمل عينة من النوع\r\n\nكتاب. لقد نجت ليس فقط خمسة قرون ، ولكن أيضًا القفزة في التنضيد الإلكتروني ، بقيت بشكل أساسي',	2,	2),
(38,	'سياسة خاصة',	'<pre>\r\nسياسة خاصة\r\n\r\nخصوصيتك مهمة بالنسبة لنا. تتمثل سياسة Sam And Ram في احترام خصوصيتك والامتثال لأي قانون ولوائح معمول بها فيما يتعلق بأي معلومات شخصية قد نجمعها عنك ، بما في ذلك عبر موقعنا الإلكتروني ، https://samandram.com ، والمواقع الأخرى التي نمتلكها ونديرها.\r\n\r\n\r\nهذه السياسة سارية اعتبارًا من 8 مارس 2021 وتم تحديثها آخر مرة في 8 مارس 2021.\r\n\r\nالمعلومات التي نجمعها\r\n\r\nتتضمن المعلومات التي نجمعها كلاً من المعلومات التي تزودنا بها عن قصد وفعالية عند استخدام أو المشاركة في أي من خدماتنا وعروضنا الترويجية ، وأي معلومات يتم إرسالها تلقائيًا بواسطة أجهزتك أثناء الوصول إلى منتجاتنا وخدماتنا.\r\n\r\nتسجيل البيانات\r\n\r\nعندما تزور موقعنا على الويب ، قد تقوم خوادمنا تلقائيًا بتسجيل البيانات القياسية التي يوفرها متصفح الويب الخاص بك. قد يتضمن عنوان بروتوكول الإنترنت (IP) الخاص بجهازك ، ونوع المتصفح وإصداره ، والصفحات التي تزورها ، ووقت وتاريخ زيارتك ، والوقت الذي تقضيه في كل صفحة ، وتفاصيل أخرى حول زيارتك ، والتفاصيل الفنية التي تحدث في بالتزامن مع أي أخطاء قد تواجهها.\r\n\r\n\r\nيرجى العلم أنه على الرغم من أن هذه المعلومات قد لا تكون معرّفة بشكل شخصي في حد ذاتها ، فقد يكون من الممكن دمجها مع بيانات أخرى لتحديد الأشخاص بشكل شخصي.\r\n\r\nمعلومات شخصية\r\n\r\nقد نطلب معلومات شخصية قد تتضمن واحدًا أو أكثر مما يلي:\r\n\r\n\r\nاسم\r\nبريد الالكتروني\r\nرقم الهاتف / الجوال\r\n\r\nأسباب مشروعة لمعالجة معلوماتك الشخصية\r\n\r\nنحن نجمع معلوماتك الشخصية ونستخدمها فقط عندما يكون لدينا سبب مشروع للقيام بذلك. في هذه الحالة ، نقوم فقط بجمع المعلومات الشخصية الضرورية بشكل معقول لتقديم خدماتنا لك.\r\n\r\nجمع واستخدام المعلومات\r\n\r\nقد نقوم بجمع معلومات شخصية منك عندما تقوم بأي مما يلي على موقعنا الإلكتروني:\r\n\r\n\r\nاشترك لتلقي التحديثات منا عبر البريد الإلكتروني أو قنوات التواصل الاجتماعي\r\nاستخدم جهازًا محمولاً أو مستعرض ويب للوصول إلى المحتوى الخاص بنا\r\nاتصل بنا عبر البريد الإلكتروني أو وسائل التواصل الاجتماعي أو أي تقنيات مماثلة\r\nعندما تذكرنا على وسائل التواصل الاجتماعي\r\n\r\n\r\nيجوز لنا جمع المعلومات والاحتفاظ بها واستخدامها والإفصاح عنها للأغراض التالية ، ولن تتم معالجة المعلومات الشخصية مرة أخرى بطريقة لا تتوافق مع هذه الأغراض:</pre>\r\n\r\n<pre>\r\nلتمكينك من تخصيص أو تخصيص تجربتك على موقعنا الإلكتروني\r\nللاتصال بك والتواصل معك\r\nللامتثال لالتزاماتنا القانونية وحل أي نزاعات قد تكون لدينا\r\nيرجى العلم أننا قد نجمع المعلومات التي نجمعها عنك مع المعلومات العامة أو بيانات البحث التي نتلقاها من مصادر أخرى موثوقة.\r\n\r\nأمن معلوماتك الشخصية\r\nعندما نقوم بجمع المعلومات الشخصية ومعالجتها ، وبينما نحتفظ بهذه المعلومات ، سنقوم بحمايتها ضمن الوسائل المقبولة تجاريًا لمنع الضياع والسرقة ، فضلاً عن الوصول غير المصرح به أو الكشف أو النسخ أو الاستخدام أو التعديل.\r\n\r\nعلى الرغم من أننا سنبذل قصارى جهدنا لحماية المعلومات الشخصية التي تزودنا بها ، إلا أننا ننصح بعدم وجود وسيلة نقل أو تخزين إلكترونية آمنة بنسبة 100٪ ، ولا يمكن لأحد أن يضمن أمان البيانات المطلق. سنلتزم بالقوانين المطبقة علينا فيما يتعلق بأي خرق للبيانات.\r\n\r\nأنت مسؤول عن اختيار أي كلمة مرور وقوتها الأمنية الشاملة ، مما يضمن أمان معلوماتك الخاصة ضمن حدود خدماتنا.\r\n\r\nكم من الوقت نحتفظ بمعلوماتك الشخصية\r\nنحتفظ بمعلوماتك الشخصية فقط للمدة التي نحتاجها. قد تعتمد هذه الفترة الزمنية على ما نستخدم معلوماتك من أجله ، وفقًا لسياسة الخصوصية هذه. إذا لم تعد معلوماتك الشخصية مطلوبة ، فسنحذفها أو نجعلها مجهولة الهوية عن طريق إزالة جميع التفاصيل التي تحدد هويتك.\r\n\r\nومع ذلك ، إذا لزم الأمر ، قد نحتفظ بمعلوماتك الشخصية من أجل امتثالنا لالتزام قانوني أو محاسبي أو إبلاغ أو لأغراض الأرشفة للمصلحة العامة أو لأغراض البحث العلمي أو التاريخي أو لأغراض إحصائية.\r\n\r\nخصوصية الأطفال\r\nلا نوجه أيًا من منتجاتنا أو خدماتنا إلى الأطفال الذين تقل أعمارهم عن 13 عامًا بشكل مباشر ، ولا نجمع عن قصد معلومات شخصية عن الأطفال دون سن 13 عامًا.\r\n\r\nالتحويلات الدولية للمعلومات الشخصية\r\nيتم تخزين المعلومات الشخصية التي نجمعها و / أو معالجتها حيث نحتفظ نحن أو شركاؤنا والشركات التابعة لنا وموفرو الطرف الثالث بمرافق. يرجى العلم بأن المواقع التي نقوم بتخزين معلوماتك الشخصية أو معالجتها أو نقلها إليها قد لا يكون لها نفس قوانين حماية البيانات مثل الدولة التي قدمت فيها المعلومات في البداية. إذا قمنا بنقل معلوماتك الشخصية إلى أطراف ثالثة في بلدان أخرى: (1) سنقوم بإجراء عمليات النقل هذه وفقًا لمتطلبات القانون المعمول به ؛ و (2) سنحمي المعلومات الشخصية المنقولة وفقًا لسياسة الخصوصية هذه.</pre>\r\n\r\n<pre>\r\nحقوقك والتحكم في معلوماتك الشخصية\r\nتحتفظ دائمًا بالحق في حجب المعلومات الشخصية عنا ، مع العلم أن تجربتك على موقعنا الإلكتروني قد تتأثر. لن نميز ضدك بسبب ممارسة أي من حقوقك على معلوماتك الشخصية. إذا قمت بتزويدنا بمعلومات شخصية ، فأنت تدرك أننا سنجمعها ونحتفظ بها ونستخدمها ونكشف عنها وفقًا لسياسة الخصوصية هذه. تحتفظ بالحق في طلب تفاصيل أي معلومات شخصية نحتفظ بها عنك.\r\n\r\nإذا تلقينا معلومات شخصية عنك من طرف ثالث ، فسنقوم بحمايتها على النحو المنصوص عليه في سياسة الخصوصية هذه. إذا كنت طرفًا ثالثًا يقدم معلومات شخصية عن شخص آخر ، فأنت تقر وتضمن أن لديك موافقة هذا الشخص على تقديم المعلومات الشخصية إلينا.\r\n\r\nإذا كنت قد وافقت مسبقًا على استخدام معلوماتك الشخصية لأغراض التسويق المباشر ، فيمكنك تغيير رأيك في أي وقت. سنوفر لك القدرة على إلغاء الاشتراك من قاعدة بيانات البريد الإلكتروني الخاصة بنا أو إلغاء الاشتراك في الاتصالات. يرجى العلم أننا قد نحتاج إلى طلب معلومات محددة منك لمساعدتنا في تأكيد هويتك.\r\n\r\nإذا كنت تعتقد أن أي معلومات نحتفظ بها عنك غير دقيقة أو قديمة أو غير كاملة أو غير ذات صلة أو مضللة ، فيرجى الاتصال بنا باستخدام التفاصيل الواردة في سياسة الخصوصية هذه. سنتخذ خطوات معقولة لتصحيح أي معلومات يتبين أنها غير دقيقة أو غير كاملة أو مضللة أو قديمة.\r\n\r\nإذا كنت تعتقد أننا انتهكنا قانون حماية البيانات ذي الصلة وترغب في تقديم شكوى ، فيرجى الاتصال بنا باستخدام التفاصيل أدناه وتزويدنا بالتفاصيل الكاملة للانتهاك المزعوم. سنحقق على الفور في شكواك ونرد عليك كتابيًا ونحدد نتيجة تحقيقنا والخطوات التي سنتخذها للتعامل مع شكواك. لديك أيضًا الحق في الاتصال بهيئة تنظيمية أو سلطة حماية البيانات فيما يتعلق بشكواك.\r\n\r\nاستخدام ملفات تعريف الارتباط\r\nنحن نستخدم &quot;ملفات تعريف الارتباط&quot; لجمع معلومات عنك وعن نشاطك عبر موقعنا. ملف تعريف الارتباط هو جزء صغير من البيانات التي يخزنها موقعنا الإلكتروني على جهاز الكمبيوتر الخاص بك ، ويتم الوصول إليها في كل مرة تزورها ، حتى نتمكن من فهم كيفية استخدامك لموقعنا. يساعدنا هذا في تقديم المحتوى لك بناءً على التفضيلات التي حددتها.\r\n\r\nحدود سياستنا\r\nقد يرتبط موقعنا الإلكتروني بمواقع خارجية لا نقوم بتشغيلها. يرجى العلم أنه ليس لدينا أي سيطرة على محتوى وسياسات تلك المواقع ، ولا يمكننا قبول المسؤولية أو المسؤولية عن ممارسات الخصوصية الخاصة بكل منها.</pre>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<pre>\r\nالتغييرات على هذه السياسة\r\nوفقًا لتقديرنا ، قد نقوم بتغيير سياسة الخصوصية الخاصة بنا لتعكس تحديثات عملياتنا التجارية أو الممارسات الحالية المقبولة أو التغييرات التشريعية أو التنظيمية. إذا قررنا تغيير سياسة الخصوصية هذه ، فسننشر التغييرات هنا على نفس الرابط الذي تصل من خلاله إلى سياسة الخصوصية هذه.\r\n\r\nإذا كان ذلك مطلوبًا بموجب القانون ، فسنحصل على إذن منك أو نمنحك الفرصة للاشتراك أو إلغاء الاشتراك ، حسب الاقتضاء ، في أي استخدامات جديدة لمعلوماتك الشخصية.\r\n\r\nاتصل بنا\r\nلأية أسئلة أو مخاوف بشأن خصوصيتك ، يمكنك الاتصال بنا باستخدام التفاصيل التالية:\r\n\r\nسام ورام\r\ninfo@samandram.com</pre>\r\n\r\n<p>&nbsp;</p>',	2,	5);
