(2868,	1434,	2,	'فيتامين d3',	'<p>فوائد فيتامين d3<br />\r\nتعزيز المناعة والوقاية من الإصابة بالأمراض.<br />\r\nمن vitamin d3 فوائد الحفاظ على صحّة القلب.<br />\r\nتحسين الحالة المزاجية، والوقاية من حدوث الإكتئاب.<br />\r\nتحفيز البنكرياس على إنتاج الإنسولين، وضبط مستوى السكّر في الدم.<br />\r\nالتقليل من تركيز مادّة الرينين في الجسم (مقبّض وعائي يتم إفرازهُ من الكلية).<br />\r\nعلاج بعض أمراض العظام، مثل الهشاشة لدى البالغين، أو الكُساح لدى الأطفال.<br />\r\nيساعد على امتصاص الكالسيوم والفوسفور ممّا يساهم في الحفاظ على صحّة كل من العظام والأسنان.<br />\r\nفوائد فيتامين d3 للنساء<br />\r\nزيادة معدّلات الخصوبة والإنجاب لدى السيّدات.<br />\r\nالوقاية من الإصابة بالأمراض الليفية في الرحم.<br />\r\nعلاج أو الوقاية من بطانة الرحم الهاجر.<br />\r\nعلاج متلازمة تكيّس المبايض.</p>\r\n\r\n<p>فوائد فيتامين د3 للشعر<br />\r\nتكوين بصيلات شعر جديدة.<br />\r\nمنح بصيلات الشعر المزيد من الكثافة.<br />\r\nمن فوائد فيتامين d3 للشعر علاج والوقاية من أمراض التساقط، مثل الثعلبة.<br />\r\nفوائد فيتامين د3 للبشرة<br />\r\nتسريع عملية التئام الجروح<br />\r\nالوقاية من حدوث جفاف البشرة.<br />\r\nمكافحة ظهور التجاعيد وعلامات التقدّم في السنّ.<br />\r\nدعم الجهاز المناعي للوقاية من الإصابة بالأمراض.<br />\r\nعلاج والوقاية من الإصابة ببعض الأمراض الجلدية، مثل الصدفية.</p>\r\n\r\n<p>فوائد فيتامين d3 للحامل<br />\r\nالوقاية من حدوث تسمّم الحمل.<br />\r\nتقليل فرص التعرّض للولادة المُبكرة.<br />\r\nتعزيز نموّ أعضاء الجسم الداخلية للجنين في رحم الأم.<br />\r\nالوقاية من الإصابة بالسكّري الحملي، أو ارتفاع ضغط الدم.<br />\r\nامتصاص عنصر الكالسيوم بالقدر الكافي لتلبية احتياجات الأم والجنين.</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
