(2880,	1440,	2,	'زيت جوز الهند العضوي',	'<p>فوائد صحية مذهلة لجوز الهند المجفف، حسب ما جاء في موقع &quot;بولدسكاي&quot; المعني بالصحة:<br />\r\n1 - المحافظة على صحة القلب ...<br />\r\n2 - تحسين وظائف المخ ...<br />\r\n3 - تعزيز المناعة ...<br />\r\n4 - الوقاية من العقم لدى الرجال ...<br />\r\n5 - علاج الأنيميا (فقر الدم) ...<br />\r\n6 - خفض خطر الإصابة بالسرطان ...<br />\r\n7 - الوقاية من مشاكل الهضم ...<br />\r\n8 - الوقاية من آلام المفاصل</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
