(2882,	1441,	2,	'زيت السلمون',	'<p>الحفاظ على صحة القلب والأوعية الدموية :<br />\r\n<br />\r\nمن ضمن أفضل 6 فوائد صحية لزيت السلمون أنه يساعد في الحفاظ على صحية القلب والأوعية الدموية بالعديد من الطرق، الأمر الذي أثبتته الدراسات التي نشرت في الجريدة الرسمية لجمعية القلب الأمريكية the Official Journal of the American Heart Association والتي أكدت على أن أحماض أوميجا 3 تساعد في الإبطاء من تراكم البلاك في الشرايين ومكافحة الالتهابات في الجسم، بالإضافة إلى دورها في الحفاظ على صحة الأوعية الدموية ومنع انسدادها، كل تلك الأمور تقلل من احتمال الإصابة بأمراض القلب والسكتات الدماغية والقلبية.<br />\r\n<br />\r\nالعمل على خفض ضغط الدم :<br />\r\n<br />\r\nمن الفوائد الصحية التي كشفت عنها الدراسات مؤخراً، دور زيت السلمون في خفض ضغط الدم في الجسم عن طريق المساعدة في انهيار الدهون الثلاثية التي تقلل بدورها من خطر الإصابة بالنوبات القلبية , heart attack وتصلب الشرايين atherosclerosis و السكتة الدماغية stroke.<br />\r\n<br />\r\nتحطيم الدهون :<br />\r\n<br />\r\nيساعد زيت السلمون في تحطيم الدهون الثلاثية التي تتمثل في EPA وDHA ، والتي تشكل بدورها خطر كبير على الجسم إذا ما تركت، حيث تؤدى إلى الإصابة بالنوبات القلبية وتصلب الشرايين.تعزيز التوازن والتنمية:<br />\r\n<br />\r\nأكدت العديد من الدراسات (ومنها ما تم نشره في المجلة الأمريكية للتغذية السريرية The American Journal of Clinical Nutrition) على ضرورة تناول أحماض أوميجا 3 وأوميجا 6 الدهنية لما لها من دور كبير وأهمية بالغة في تعزيز التطور الطبيعي والتوازن للجسم.<br />\r\n<br />\r\nالتخفيف من أعراض التهاب المفاصل :<br />\r\n<br />\r\nتساعد أحماض أوميجا 3 الدهنية في قمع الجينات الالتهابية مما يساعد على مكافحة العديد من الالتهابات من ضمنها التهاب المفاصل والأمراض المزمنة ذات الصلة، وذلك وفق آخر الدراسات (معهد العلوم الطبية الحيوية والحياة Institute of Biomedical and Life Sciences في جامعة غلاسكو University of Glasgow) وفي العديد من الجهات المتخصصة.<br />\r\n<br />\r\nالحفاظ على صحة الدماغ :<br />\r\n<br />\r\nوفق آخر الأبحاث التي تمت على أحماض أوميجا 3 الدهنية الموجودة في زيت السلمون، زاد من اعتقاد أن هذه الأحماض لها دور كبير في الحفاظ على صحة الدماغ المثلى ، ولازالت هذه الدراسات مستمرة إلى الآن لتكشف عن المزيد من التطورات والاكتشافات عن فوائد زيت السلمون، الذي يعتقد أيضاً أن له دور كبير في مكافحة الاكتئاب والحماية من الأمراض الناتجة عن التقدم في السن مثل مرض الزهايمر.</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
