(2888,	1444,	2,	'فيتامين c',	'<p>تحسين امتصاص الحديد.<br />\r\nتقليل مخاطر الإصابة بفقر الدم.<br />\r\nيحارب الشيخوخة، ويُقلّل من التجاعيد.<br />\r\nيقي من الإصابة ببعض أنواع السرطان.<br />\r\nمضادّ أكسدة قوي، يُسرّع من عملية التئام الجروح.<br />\r\nدعم الجهاز المناعي، وتحفيز إنتاج خلايا الدم البيضاء (اللمفاويات).<br />\r\nيقوّي الذاكرة، ويقلل الإصابة ببعض أمراض الجهاز العصبي المركزي.</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
