(2890,	1445,	2,	'حبوب المضغ للحموضة وحرقة المعدة TUMS',	'<p>حبوب المضغ للحموضة وحرقة المعدة TUMS<br />\r\n<br />\r\nحبوب المضغ TUMS لعلاج الحموضه وحرقة المعدة<br />\r\n<br />\r\nوارتجاع المرئ وآلام المعده الناتجه عن الغثيان<br />\r\nمكونه من كربونات الكالسيوم وعدد من الفيتامينات والمكونات والنكهات الطبيعيه<br />\r\nتناولي قطعه او قطعتين عند الشعور بحرقة المعده<br />\r\nتقضي على احساس الحرقه المزعج حالاً وخلال ثواني<br />\r\nمتوفره بنكهة الفواكه<br />\r\n.<br />\r\nتناسب الحامل والمرضع<br />\r\nتناسب بعد عمليات التكميم وتصغير المعده<br />\r\nتناسب جميع الأعمار</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
