(2892,	1446,	2,	'سليب ايد',	'<p>سليب ايد Sleep Aid أقراص لعلاج الأرق واضطرابات النوم من خلال موقع محتوى, يستخدم عقار سليب ايد في علاج اضطرابات النوم وعدم القدرة على النوم بهدوء ويساعد على النوم لساعات طويلة فهو يحتوى على مادة زاليبون والتي تساعد على ارتخاء عضلات الجسم والرغبة في النوم.</p>\r\n\r\n<p>&nbsp;</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
