(2896,	1448,	2,	'بربرين من بذور البرباريس',	'<p>- تعزيز المستويات الصحية للسكر في الدم<br />\r\n<br />\r\nإدارة الوزن الصحي<br />\r\n<br />\r\nصحة القلب<br />\r\n<br />\r\nصحة المفاصل والعظام<br />\r\n<br />\r\nصحة الجهاز الهضمي وتعزيز المناعة<br />\r\n<br />\r\nوظائف الرئة والوقاية من السرطان<br />\r\n<br />\r\nالصحة العقلية<br />\r\n<br />\r\nصحة الكبد<br />\r\n<br />\r\nتعزيز فعالية المضادات الحيوية<br />\r\n<br />\r\n10- فوائد صحية للنساء<br />\r\n<br />\r\nتقول دراسات حديثة أن البربرين يمكن أن يكون له فوائد عديدة للنساء اللاتي يعانين من متلازمة تكيَّس المبايض، وكذلك تحسين الخصوبة والمساعدة في انقاص الوزن وتخفيض خطر المضاعفات الأيضية المرتبطة بالمتلازمة مثل مرض السكري من النوع 2 والكولسترول العالي وأمراض الكبد الدهنية.<br />\r\n<br />\r\nكذلك تشير الأبحاث إلى أن تناول البربرين والصويا يمكن أن يقلل من أعراض انقطاع الطمث.</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
