(2902,	1451,	2,	'استخراج سوانسون شيلاجيت',	'<p>الشيلاجيت فوائد عظيمة لا حصر لها<br />\r\nتستطيع تفهم التكالب الكبير مؤخرا من العالم للحصول على هذه المادة الفريدة من نوعها من خلال جملة من الفوائد للشيلاجيت على صحة الانسان اكتشفها أهل الشرق منذ آلاف السنين :<br />\r\n<br />\r\nمادة غنية بحمض الفوليك<br />\r\nيساعد حامض الفوليك الجسم على امتصاص المواد المغذية الأخرى في العظام والعضلات وهذا ما يجعله عنصرا مهما في جسم الانسان. وقد أكد طب الايورفيدا أن مادة الشيلاجيت حين تضاف إلى الأعشاب الأخرى تحسن من وظيفة حمض الفوليك في الجسم. ويرجح أنها تتضمن حوالي 40-60٪ حامض الفوليك، لذلك تعتبر مادة غنية بالفائدة لجسمك.<br />\r\n<br />\r\nتعزز القدرات العقلية والجسدية<br />\r\nيدرك الأطباء في الايورفيدا قيمة التمثيل الغذائي ودوره في تفادي مشاكل صحية كبرى للفرد وحين يتعلق الأمر بالكوابيس واضطرابات النوم والعصبية، وفقدان الذاكرة والاكتئاب وغيرها من المشاكل النفسية المرتبطة بتسارع نمط الحياة اليوم، فإن مادة الشيلاجيت تبرز كمادة معالجة لكل ما ذكر لأنه يعزز وظائف الجسم لدى الانسان و بالتالي فإن الراحة النفسية ستؤثر مباشرة على القدرات الجسدية فيساعد كل الأعضاء على العمل على المستوى الأمثل.<br />\r\n<br />\r\nيعزز القدرة الجنسية والأداء لدى الرجال<br />\r\nقديما كان المعالجون القدامى في التبت ونيبال وبوتان جميعهم قد وصفوا الشيلاجيت لإيقاظ القدرة الجنسية لدى الرجال، فإن كنت تشعر بالملل والروتين وتريد المزيد من الحماس والبهجة، إلجأ إلى خلطة سحرية من بعض الأعشاب المحلية مع مادة الشيلاجيت في اسرع وقت ممكن، إنها تزيد من تحسين وزيادة الحيوانات المنوية وهذا هو السبب ليطلق عليها الفياجرا الهندية فلها تأثير يكافئ عمل الفياجرا.<br />\r\n<br />\r\nمعالج جيد لمشاكل النساء<br />\r\nفي المقابل فإن الشيلاجيت مفيد أيضا للنساء من خلال جملة من الفوائد منها أنه يشفي العقم، يحسن الدورة الشهرية غير النظامية، يوفر قوة ويحسن أعراض نقص الكالسيوم، يساعدهن على البقاء في كامل عطائهن حتى بعد ساعات طويلة من العمل، يقلل من أعراض الشيخوخة مثل التجاعيد وفقدان الشعر، كما ويحسن كثافة العظام ويقلل من آثار التهاب المفاصل.<br />\r\n<br />\r\nتقلل من الإجهاد<br />\r\nوفقا لنصوص الايورفيدا، فالشيلاجيت هو علاج ممتاز من أجل مقاومة الإجهاد والعمل على تنشيط الجسم. والمفاجأة هو أن الشلاجيت ليس له آثار جانبية سيئة مثل بعض مخلفات المهدئات العادية ، فالشيلاجيت لا يستغرق سوى وقت قليل جداً من أجل الخروج من الجسم مع أي آثار متبقية معه.<br />\r\n<br />\r\nمنتج يزيد الجمال<br />\r\nيصلح الشيلاجيت قناعاً على الوجه أ]ضا وإن له أثراً ممتازاً، يمكنك خلط ملعقة صغيرة من الشيلاجيت مع ماء الورد والكرز المهروسة أو عصير الفواكه ( مع الحرص أن يكون كل السكر طبيعي وليس اصطناعياً)، ثم قومي بخفق كل هذه المكونات معاً حتى يصبح أشبه بالعجين، ضعي عجينة رقيقة على وجهك النظيف، والجاف واتركيها لمدة تصل إلى 5-10 دقائق، ثم قومي بإزالة العجين بقطعة قماش دافئة، ورطبة باستخدام حركات دائرية لطيفة، وسوف تبدو بشرتك مذهلة.<br />\r\n<br />\r\nيحسن المناعة<br />\r\nيستخدم المعلم ديفيد وولف الشيلاجيت في العصائر، ويرش منها على السلطة. حيث تترك عليها طعم الدخان بشكل طبيعي، لذلك يمكنك أيضا نشر بعضها على شرائح الأفوكادو أو إضافتها إلى البيض المخفوق للحصول على دفعة لذيذة بالإضافة إلى الحصول على كمية كبيرة من المواد المضادة للأكسدة، حيث أظهرت الدراسات أن شرب الشيلاجيت يعمل أيضاً على الشفاء بشكل أسرع من الأمراض حيث يعزز جهاز المناعة، ويساعد الجسم على محاربة المرض والعدوى.<br />\r\n<br />\r\nيساعد على تقليل علامات التجعد<br />\r\nيجري الآن استخدام الشيلاجيت من أجل المساعدة في علاج علامات التجعد. وذلك لأنه ينشط الدورة الدموية ويمكن أن يوضع كقناع في أي مكان على الجسم. فهي مادة ممتازة لمحاربة شيخوخة الجلد، مما يترك لكم شعورا بنعومة البشرة وجعلها متجددة ونشطة.</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
