(2908,	1454,	2,	'الوردي البزموت',	'<p>ما هي استخدامات بسموث سبساليسيلات؟<br />\r\nيستخدم في علاج بعض حالات الاسهال و في الوقاية ضد الاصابة باسهال المسافرين و يستخدم في علاج قرحة الأثني عشر النشطة أو الملتئمة (يستخدم مع عدد من العلاجات الأخرى للتخلص من جرثومة المعدة أو البكتيريا الملوية الوابية).</p>\r\n\r\n<p>&nbsp;</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
