(2912,	1456,	2,	'الكولاجين الببتيدات',	'<p>منافع ببتيدات الكولاجين:<br />\r\n<br />\r\nإنتاج الكولاجين في البشرة، إزالة التجاعيد، شدّها وإعادة المرونة إليها.<br />\r\nترطيب البشرة من الأعماق.<br />\r\nالحدّ من آلام وتصلّب العضلات والمفاصل وتعزيز حركتها ومرونتها.<br />\r\nتقوية الأظافر.</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
