(2918,	1459,	2,	'نيكوريت 2 ملغ',	'<p>nicorette 2mg لبان نيكوتين هي علكة أو لبان ينصح باستخدامه عند محاولة الإقلاع عن التدخين ، وذلك لأنها تعمل على تخفيف اعراض الانسحاب من التدخين حيث يتم خفض نسبة النيكوتين بها ومن ثم الاستعداد للتوقف بشكل نهائي.</p>\r\n\r\n<p>فوائد نيكوريت دواء</p>\r\n\r\n<p>لبان نيكوريت nicorette 2mg تساعد على الحد من أعراض الانسحاب البدني للتدخين</p>\r\n\r\n<p>لبان نيكوتين يساعد على الحد من أعراض الانسحاب النفسية مثل القلق والتوتر والعصبية.</p>\r\n\r\n<p>nicorette تساعد الاستعداد للإقلاع عن التدخين بشكل نهائي.</p>\r\n\r\n<p>nicotine gum egypt تساعد المدخنين الذين يدخنون بكثافة متوسطة إلى شديدة</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
