(2932,	1466,	2,	'محسن الغدة الكظرية',	'<p>ADRENAL OPTIMIZER براند JARROW عدد 120 كبسولة</p>\r\n\r\n<p>مركب من المكونات التي تدعم عمل الغدد الكظرية. يشارك فيتامين ج وحمض البانتوثنيك في تصنيع وإفراز هرمونات الغدة الكظرية. تعمل المستخلصات النباتية على تجديد مستقبلات الغدة الكظرية. المنتج هو حل جيد للأشخاص الذين يعانون من الإجهاد.</p>',	NULL,	0,	NULL,	0,	0,	NULL,	0,	0),
