(2938,	1469,	2,	'خل التفاح',	'<p>خل التفاح براند DR MERCOLA عدد 30 تابلت</p>\r\n\r\n<p>أن خل&nbsp;<strong>التفاح</strong>&nbsp;هو&nbsp;<strong>الخل</strong>&nbsp;الذي يتم الحصول عليه من&nbsp;<strong>التفاح</strong>&nbsp;، وهو معروف منذ الاف السنين كان يستخدم قديما ً كمادة حافظة للأطعمة والمواد الغذائية ، وهو يعتبر الأن واحد من العلاجات البديلة الصحية فهو يستخدم لعلاج العديد من الأمراض لما له من خصائص سحرية.</p>',	NULL,	0,	NULL,	0,	0,	NULL,	0,	0),
