(2940,	1470,	2,	'ميثيل سلفونيل ميثان',	'<p>MSM براند DR MERCOLA عدد 60 تابلت</p>\r\n\r\n<p>كمُضادّ حيوي طبيعي لِعلاج الالتهابات المُختلفة. للمُحافظة على صحّة عضلة القلب والأنسجة القلبية. لأمراض الجهاز المناعي وضعف خلايا الجهاز المناعي أو عدم تعرّفها على خلايا الجسم الطبيعية ومُهاجمتها. لالتهاب الجيوب &ndash; Sinusitis الأنفية والتهاب الأذن &ndash; Otitis.</p>',	NULL,	0,	NULL,	0,	0,	NULL,	0,	0),
