(2942,	1471,	2,	'ل كارتين',	'<p>ل كارتين براند DR BEST عدد ٦٠ كبسولة تركيز 500 ملى جرام</p>\r\n\r\n<p>الكارنيتين (<strong>الكارنتين</strong>)&nbsp;<strong>L</strong>-<strong>Carnitine</strong>&nbsp;أو(<strong>L</strong>-3-hydroxytrimethylamminobutanoate) عبارةٌ عن مركبٍ شبيهٍ بالأحماضِ الأمينيّةِ، يتمّ تركيبُه بشكلٍ طبيعيٍ في الأنسجةِ الحيوانية (اللحوم) بالدرجةِ الأولى، والحليب إلى حدٍ ما، وهو واحدٌ من مكوناتِ الحليبِ البشري أيضاً</p>\r\n\r\n<p>كما ان الكارنتين يساعد بشكل كبير في انقاص الوزن وحرق الدهون بشكل كبير</p>',	NULL,	0,	NULL,	0,	0,	NULL,	0,	0),
