(2962,	1481,	2,	'ماستك جام',	'<p>ال ماستك جام براند NUTRICOLOGY عدد 120 كبسولة</p>\r\n\r\n<p>نظرة عامة على المنتج الوصف التغذية المبتكرة مكمل غذائي Chios Gum Mastic مضاد للحساسية هو مادة راتنجية يتم الحصول عليها من شجرة Pistacia lentiscus ، التي تزرع في جزيرة خيوس في اليونان. الاستخدام المقترح كمكمل غذائي ، كبسولة واحدة إلى كبسولتين مرتين يوميًا بين الوجبات ، أو حسب توجيهات ممارس الرعاية الصحية. المكونات الأخرى هيدروكسي بروبيل ميثيل سلولوز ، السليلوز الجريزوفولفين ، ستيرات المغنيسيوم ، ثاني أكسيد السيليكون. تحذيرات قد تحدث تغيرات في لون المنتج. يحفظ في مكان بارد وجاف، توج بإحكام. إخلاء المسؤولية بينما تسعى iHerb جاهدة لضمان دقة صور المنتج ومعلوماته ، قد تكون بعض تغييرات التصنيع على العبوة و / أو المكونات قيد التحديث على موقعنا. على الرغم من أنه قد يتم شحن العناصر أحيانًا مع عبوات بديلة ، إلا أن النضارة مضمونة دائمًا. نوصي بقراءة الملصقات والتحذيرات والتوجيهات الخاصة بجميع المنتجات قبل الاستخدام وعدم الاعتماد فقط على المعلومات المقدمة من iHerb. زيارة موقع الشركة المصنعة ...</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
(2963,	1482,	1,	'sea kelp',	'',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
(2964,	1482,	2,	'عشب البحر',	'<p>عشاب البحر SEA KELP براند wild harvest عدد ٩٠ كبسولة</p>\r\n\r\n<p>خزان اليود الطبيعي</p>\r\n\r\n<p>يعد عشب البحر مصدر ممتاز لعنصر اليود الضروري لأداء جيد للغدة الدرقية</p>\r\n\r\n<p>.منجم معادن</p>\r\n\r\n<p>تحتوي اعشاب البحر على المعادن المطلوبة لصحة الانسان</p>\r\n\r\n<p>غنية ايضا بالمغذيات الصغرى و هي الكوبالت و النحاس و الكروم و الفلور و المنغنيز و المولبدنم و السلينيوم و الزنك والبوتاسيوم</p>\r\n\r\n<p>غني جدا بالفيتامينات</p>\r\n\r\n<p>(أ ، ب1 ، ج ، هـ ، ك )</p>\r\n\r\n<p>و مصدراً جيداً جداً لفيتامين( ب 9). وب١٢،</p>\r\n\r\n<p>البروتين.</p>\r\n\r\n<p>استخداماته :</p>\r\n\r\n<p>.</p>\r\n\r\n<p>*خفض هرمون الغدة الدرقية و هو الاستخدام الأكثر شهرة لكن يحذر من استخدامه عند زيادة نشاط الغدة .</p>\r\n\r\n<p>*معالجة ارتفاع ضغط الدم .</p>\r\n\r\n<p>*علاج التهاب المفاصل و العظام .</p>\r\n\r\n<p>*للتنحيف و تقليل الوزن</p>\r\n\r\n<p>*مكمل غذائي .</p>\r\n\r\n<p>*يحفز انتاج كرات الدم الحمرا لانه غني بالكلوروفيل</p>\r\n\r\n<p>*الحد من مخاطر الأصابه بالسرطان</p>\r\n\r\n<p>*تحسين نظام المناعه</p>\r\n\r\n<p>*تحقيق التوازن ف مستويات الحموضة ف الجسم</p>\r\n\r\n<p>*حماية ضد التسمم الإشعاعي</p>\r\n\r\n<p>**تنبيه هام : اليود يستخدم فقط تحت اشراف الطبيب او بتوصيه من الطبيب **</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
(2965,	1483,	1,	'Olive leaf extract',	'',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
(2966,	1483,	2,	'مستخلص أوراق الزيتون',	'<p>مستخلص أوراق الزيتون للمناعة براند COMVITA</p>\r\n\r\n<ul>\r\n	<li>استخرجة أوراق الزيتون كومفيتا يسلم الدعم المناعي الطبيعي، ويساعد على الحفاظ على نظام القلب والأوعية الدموية صحية كما أنه يدعم ضغط الدم الطبيعي ومستويات الكوليسترول في الدم في الأفراد الأصحاء.</li>\r\n	<li>بندنة: يستخدم مستخرج أوراق الزيتون كومفيتا تقليديا لدعم وظيفة القلب والأوعية الدموية وقد يساعد في الحفاظ على ضغط الدم الطبيعي / الصحي في الأفراد الأصحاء. توفر كل ملعقة صغيرة 22mg oleuropein (أي ما يعادل 5000 ملغ أوراق طازجة) ، والمكون النشط في ورقة الزيتون، وهذا المنتج غير معدل وراثيا ولا يحتوي على أي الكحول المضافة، والسكر، والخميرة، والنكهات الاصطناعية، والألوان الاصطناعية أو المواد الحافظة.</li>\r\n	<li>مصدرها ومصدرها: هذا المنتج مصنوع من أوراق الزيتون الطازجة التي تزرع في مزرعتنا التي تبلغ مساحتها 600 فدان مع أكثر من 840,000 شجرة زيتون في كوينزلاند الريفية، أستراليا، حيث يتطابق المناخ مع المناخ في البحر الأبيض المتوسط. مدير المزارع لدينا يميل إلى الأرض ويضمن ممارسات زراعية مستدامة تدعم الموئل الطبيعي للحياة البرية المحلية</li>\r\n	<li>.</li>\r\n	<li>البحث العلمي: أظهرت الأبحاث المستفيضة في النظام الغذائي المتوسطي أن زيت الزيتون، والأهم من ذلك، المركبات النشطة في زيت الزيتون تسمى الفينولات، ترتبط بالحفاظ على الصحة</li>\r\n	<li>.</li>\r\n	<li>usage: يستخدم استخراج أوراق الزيتون كومفيتا على أفضل نحو كمكمل صحي يومي، يؤخذ مع أو بعد تناول الطعام. يوصى بتناول 1 ملعقة صغيرة (5 مل) 2-3 مرات</li>\r\n	<li>في اليوم.</li>\r\n</ul>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
