(2968,	1484,	2,	'حليب الشوك',	'<p>حليب الشوك ليبوزومال عدد ٩٠ كبسولة براند NATUERS</p>\r\n\r\n<p>ميلك ثيستل للكبد هى مكمل غذائي طبيعي من مستخلص حليب الشوك، يعمل على علاج مشكلات الكبد و المرارة ودعم صحتهم، كما ان milk thistle من أهم منتجات ازالة السموم أو الديتوكس detox التى تقوم بتنقية الجسم من السموم مما يقوى المناعة بشكل كبير.</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
