(2970,	1485,	2,	'حليب الشوك',	'<p>حليب الشوك كبسولات عدد 100 كبسولة براند JARROW</p>\r\n\r\n<p>Jarrow الصيغ حليب الشوك (الخرفيش) (Silybum marianum) 30:1 التركيز هو موحدة لاحتواء 80% مجموع حليب الشوك (الخرفيش) البذور الفلافونويد ، بما في ذلك أهمية سيليمارين الكسور isosilybinins ألف وباء ، silybinins ألف وباء ، silychristin و silydianin.</p>\r\n\r\n<ul>\r\n	<li>موحدة سيليمارين استخراج 30:1</li>\r\n	<li>خيارات الأطعمة الخالية من الجلوتين</li>\r\n	<li>يدعم وظيفة الكبد</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>هذه الفئة المحددة من الفلافونويدات ، بشكل جماعي المعروفة باسم سيليمارين ، يدعم وظيفة الكبد عن طريق رفع واقية الجلوتاثيون المستويات.</p>\r\n\r\n<p><br />\r\nواقترح الاستخدام<br />\r\n&nbsp;</p>\r\n\r\n<p>خذ 1 كبسولة يوميا أو حسب توجيهات الخاص بك صحي مؤهل مستشار الرعاية.</p>\r\n\r\n<p>&nbsp;</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
