(2972,	1486,	2,	'محسن الغدة الكظرية',	'<p>ADRENAL OPTIMIZER براند JARROW عدد 120 كبسولة</p>\r\n\r\n<pre>\r\nيدعم تجديد الغدة الكظرية وتقليل التوتر ؛ 11 مادة مغذية تدعم صحة الغدة الكظرية\r\n100 ملغ مستخلص جذر اليوثيرو ؛ 100 ملغ خلاصة اشواغاندا سينسيل\r\nأدابتوجين عشبي مشهور\r\nDMAE والفيتامينات C و B5\r\nمفيد في تخليق / إفراز هرمون الغدة الكظرية</pre>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
