(2974,	1487,	2,	'الالكترولايت بودر',	'<p>الالكترولايت براند DR BERG</p>\r\n\r\n<pre>\r\nمكمل غذائي لإنقاص الوزن | شراب كامل من المعادن والمعادن النادرة. 100٪ طعم توت العليق والليمون القابل للذوبان. لا إضافات | لا يوجد سكر مضاف! لا يحتوي على مكونات معدلة وراثيًا أو جلوتين أو مكونات صناعية! هيدرات | الالكتروليتات ضرورية للطاقة الخلوية والعضلات ووظيفة الأعصاب. سيساعدك هذا المشروب على تجديد وتجديد طاقتك الخلوية وترطيبها. غني بالبوتاسيوم | هذه الإلكتروليتات الكاملة والمتوازنة والقابلة للذوبان تعطي 1000 مجم من البوتاسيوم لكل حجم حصة. هذا أعلى من أي مسحوق إلكتروليت في السوق. تحتاج أجسامنا إلى 4700 مجم من سترات البوتاسيوم كل يوم والعديد من الناس يحصلون على جزء بسيط من هذا في نظامهم الغذائي. ستحصل أيضًا على الإلكتروليتات الأخرى بتوازن مثالي.</pre>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
