(2980,	1490,	2,	'كولاجين بقري',	'<p>كولاجين ببتايد بقرى وزن ٢٨٣ جرام باودر براند ZINT</p>\r\n\r\n<p>مكمل غذائي يحتوي على ببتيدات الكولاجين النقي مستخرج من الابقار التي تتغذي على الاعشاب بشكل طبيعي بدون اي اضافات ضارهاو هرمونات.<br />\r\nيساعد الكولاجين البقري على انتاج وتجدد الكولاجين في الجسم ويزيد من رطوبة ونعومة البشرة بالاضافة الي انه يدعم صحة الشعروالمفاصل.<br />\r\nتم اختبار وفحص المنتج للتأكد من خلوه من المواد المعدلة وراثيا والعلوتين والمضادات الحيوية والهرمونات .</p>\r\n\r\n<p>المنتج حاصل عى تقييم ممتاز ومن اكثر منتجات الكولاجين شراءً في موقع اي هيرب.<br />\r\nعمد استخدامك لهذا الكولاجين ستحصلين على شعر قوي وثابت ودون تساقط بالاضافة الي زيادة في رطوبه ونعومة البشرة وليونة المفاصلوقوة في العظام والغضاريف والاوتار.</p>\r\n\r\n<p>&nbsp;</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
