(2988,	1494,	2,	'ماتشا',	'<p>ماتشا يابانى بيور اورجانيك براند SENCHA وزن 113 جرام تكفى لعمل 75 Serv</p>\r\n\r\n<ul>\r\n	<li>منتج ياباني ممتاز للاستعمال اليومي</li>\r\n	<li>خالٍ من الجلوتين</li>\r\n	<li>غير معدل وراثيًّا</li>\r\n	<li>شاي أخضر مناسب للعديد من الوصفات.</li>\r\n</ul>\r\n\r\n<p>مزروع في الظل، أوراق كاملة من الشاي الأخضر، غذاء فائق القيمة الغذائية مناسب للشرب، مشروبات وعصائر مخفوقة رائعة، مناسب للخبز والمزيد.</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
