(2992,	1496,	2,	'شواجندا اورجانيك باودر',	'<p>اشواجندا اورجانيك باودر وزن 200 جرام باودر براند ORGANIC TRIDITON</p>\r\n\r\n<p>اشواجندا باودر اورجانيك 200 جرام</p>\r\n\r\n<p>معتمد كمنتج عضوى من USDA و ECOCIRT ICO</p>\r\n\r\n<p>كما هو معروف اشواغاندا باسم الجينسنغ الهندي لأن أفعاله واستخداماتها تشبه تلك التي الجينسنغ الصيني. في حين أنها واحدة من أكثر الجذور شيوعًا في الطب الهندي التقليدي للأيورفيدا لزيادة القدرة على التحمل ، إلا أنها تستخدم أيضًا لتعزيز العقل الهادئ وتشجيع النوم. يستخدم على نطاق واسع في الهند كعلاج يومي ومنزل.</p>\r\n\r\n<p>أضف إلى الماء ، ماء جوز الهند والعصائر ، عصائر المقويات ، الزبادي والتوت ، الحلويات والمزيد</p>\r\n\r\n<p>&nbsp;</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
