(2994,	1497,	2,	'عسل المانوكا',	'<p>عسل المانوكا براند MANUKA HEALTH تركيز 573</p>\r\n\r\n<p>عسل مانوكا هوني النيوزلندي هو واحد من أفضل أنواع العسل على الإطلاق، وذلك لأنه عسل احادى النكتار MGO 573+، ويتميز عن باقى الانواع بأنه غنى بمجموعة من أهم الفيتامينات والمعادن التى تجعله يحتوى على 4 أضعاف القيمة الغذائية الموجودة فى اى عسل آخر، مما يجعل تناوله بشكل منتظم شئ ضرورى لصحة افض</p>\r\n\r\n<p>&nbsp;</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
