(3022,	1511,	2,	'الثور الصفراء',	'<p>الإمساك المزمن<br />\r\nحصى في المرارة<br />\r\nالتهاب الكبد</p>\r\n\r\n<pre>\r\nمشتق من مصدر بقري وهو مكمل مناسب لإنتاج الكبد للصفراء *.\r\nيدعم هضم وامتصاص الدهون والفيتامينات القابلة للذوبان في الدهون A و D و E و K *.\r\nالاستخدام المقترح: تناول كبسولة واحدة من مرة إلى ثلاث مرات يوميًا مع وجبات تحتوي على دهون ، أو حسب التوجيهات.\r\nخالٍ من القمح والغلوتين ومنتجات الألبان والبيض وفول الصويا والأسماك والمحار والفول السوداني والمكسرات والذرة والخميرة.\r\nمنذ عام 1979: تستخدم NutriCology فقط أنقى المواد الخام ، مع رقابة صارمة على الجودة.\r\nمستورد من الولايات المتحدة الأمريكية.</pre>\r\n\r\n<p>&nbsp;</p>',	NULL,	0,	NULL,	0,	0,	NULL,	0,	0),
