(3008,	1504,	2,	'كوانترو  هيفي  ميتل ديتوكس',	'<p>من أفضل المنتجات اللى جربتها للديتوكس</p>\r\n\r\n<p>مزيج ساحر من خلاصة الكزبرة مع الكلوريلا السائلة واحنا عارفين ان الصيغ السائلة قوية جدا</p>\r\n\r\n<p>الكزبرة بتسحب السموم من المخ بالذات وده للناس اللى بيعانوا من ضعف التركيز او الاجهاد العقلى بسبب السموم اللى اكيد موجودة حوالينا فى كل مكان&nbsp;</p>\r\n\r\n<p>وتربطها على طول بالكلوريلا اللى بتشيل السموم لحد ما بتخرجها برة الجسم تماما</p>\r\n\r\n<p>وبالتالى ميكونش فى اعراض جانبية للديتوكس</p>\r\n\r\n<p>ونضمن ان السموم متتراكمش فى الجسم</p>\r\n\r\n<p>ويا سلام لو اخدناها مع الاسبرولينا كمان هتدى طاقة عالية جدا</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
