(3010,	1505,	2,	'نيم أورا',	'<p>تحتوي شجرة النيم على مواد كيميائية تمنحها خصائص صحية تجعلها تساهم فس علاج امراض عدة منها السكر، البواسير المشاكل الجلدية وغيرها</p>\r\n\r\n<p>حلقة دكتور كريم على عن استخدامات النيم</p>\r\n\r\n<p>حلقة دكتور كريم على عن استخدام زيت النيم</p>\r\n\r\n<p>للمساعدة في دعم الجهاز المناعي وكجزء من النظام الغذائي للحفاظ على مستويات سكر صحية في ضمن النطاق العادي.</p>\r\n\r\n<p>هذا 3X concentration مقارنة بمستخلص Regular Strength Extract. النيم هو عشب قوي للغاية ويجب أن يستخدم بحذر. يعتبر النيم واحدًا من العشاب الأكثر فائدة عمومًا في العالم، وله تاريخ في الاستخدام في القليد الهندي القديم يعود إلى ما يقرب من 5 آلاف سنة. صححت الأبحاث العلمية الحديثة الكثير من الاستخدامات التقليدية لهذا العشب. يدعم النيم وظيفة الجهاز المناعي السليمة وكجزء من نظام غذائي للحفاظ على مستويات سكر صحية في الدم ضمن المعدل الطبيعي.</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
(3011,	1506,	1,	'Chanca Piadra',	'',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
(3012,	1506,	2,	'شانكا بيادرا',	'<p>شانكا بيادرا مستخلص سائل قوى</p>\r\n\r\n<p>محطمة حصوات الكلى والمرارة</p>\r\n\r\n<p>الماركة دى هايلة وكمان بصيغتها السائلة رهيبة فى مفعولها بجد اقوى من الباودر والكبسولات بمراحل</p>\r\n\r\n<p>&nbsp;يبدو من اسمها &quot;كسر الحجر&quot; قدرتها على دعم صحة الكلى والكبد والمرارة</p>\r\n\r\n<p>ما هي فوائد عشبة الشانكا بيدرا الصحية؟</p>\r\n\r\n<p>قدرتها على مساعدة صحة الجهاز الهضمي والكلى،</p>\r\n\r\n<p>تم استخدام هذه النباتات من قبل السكان الأصليين كجزء من الطب التقليدي بسبب مجموعة متنوّعة من المركبات الفينولية الموجودة في هذا النبات والتي يمكن أن يكون لها العديد من التأثيرات على الجسم خاصةً عندما تؤخذ بجرعات مناسبة ، إن هذه العشبة آمنة تماماً.</p>\r\n\r\n<p>ومن أهم فوائدها:</p>\r\n\r\n<p>تفتيت حصوات الكلى المتكونة فى المسالك البولية.</p>\r\n\r\n<p>علاج المرضى المصابون بالتهاب الكبد الفيروسى.</p>\r\n\r\n<p>خفض للسكر فى الدم.</p>\r\n\r\n<p>مضادة للعدوى الفطرية.</p>\r\n\r\n<p>تمنع الأصابة بالسرطان</p>\r\n\r\n<p>وقد أثبت علمياُ مدى أهمية استخدام الشنكابيدرا فى علاج حالات التهاب الكبد الفيروسى الحاد من النوع A و B بفضل فاعلية تلك العشبة الهندية فى علاج حالات التهاب الكبد الفيروسى الحاد من نوع (AVH).</p>\r\n\r\n<p>ومن أهم استخدامات عشبة (الشانكابيدرا الأخرى:</p>\r\n\r\n<p>مسكنة للآلام</p>\r\n\r\n<p>مضادة لمختلف الالتهابات</p>\r\n\r\n<p>مضادة للبكتريا</p>\r\n\r\n<p>علاج لالتهابات الكبد الفيروسية</p>\r\n\r\n<p>تمنع تكوّن حصوات الكلى</p>\r\n\r\n<p>تساعد على تفتيت الحصوات المتكونة في الكلى</p>\r\n\r\n<p>علاج للملاريا والأمراض السرطانية،</p>\r\n\r\n<p>طاردة للديدان</p>\r\n\r\n<p>مضاد للتقلصات</p>\r\n\r\n<p>طاردة للرياح</p>\r\n\r\n<p>تساعد على الهضم</p>\r\n\r\n<p>مدرة للبول</p>\r\n\r\n<p>تخفض مستوى السكر المرتفع فى الدم</p>\r\n\r\n<p>تخفض أمستوى ضغط الدم المرتفع</p>\r\n\r\n<p>تتميّز عشبة الشانكا بييدرا بخصائصها المسكّنة للآلام وهي عشبة غنية بالفيتوكيميكال الهام لتعزيز مناعة الجسم وحمايته من الكثير من الأمراض، كما أنها غنيّة بالقلويدات، والأستراجالين، والبريفيوفولين، حمض الكربوكسيليك، وحمض الايلجييك، والجالوكتشين، والليجنين، وسليسيلات الميثيل، والروتين، والكورستين، والصابونيات.</p>\r\n\r\n<p>&nbsp;قد يكون من أهم منافع تناول تلك العشبة هو للتعامل مع حصوات الكلى وحصوات المرارة، والتهابات الكبد، ونزلات البرد، والسل الرئوى، وأنواع أخرى من العدوى الفيروسية، وحالات الأنيميا، والصفراء، وسرطان الكبد، وأمراض العدوى البكترية، مثل التهاب المثانة، والبروستاتة.</p>\r\n\r\n<p>&nbsp;</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
