(3014,	1507,	2,	'ميثيل فولات',	'<p>ميثيل فولات تركيز 800 ملليجرام مع فيتامين B12 تركيز 5000 ملليجرام (ميثيل كوبالامبين)</p>\r\n\r\n<p>اقراص استحلاب تحت اللسان او للمضغ</p>\r\n\r\n<p>60 قرص تكفى شهرين</p>\r\n\r\n<p>إنتاج الطاقة ووظيفة الدماغ</p>\r\n\r\n<p>نباتي</p>\r\n\r\n<p>مناسب للنباتيين</p>\r\n\r\n<p>يجمع Jarrow Formulas&reg; Methyl-B12 ، Methylfolate Plus Pyridoxal-5-Phosphate (P5P) Tablet</p>\r\n\r\n<p>الأشكال النشطة لهذه الفيتامينات لدعم تخليق الحمض النووي والناقلات العصبية واستقلاب الأحماض الأمينية.</p>\r\n\r\n<p>&nbsp;يتم تحويل الهوموسيستين إلى ميثيونين بواسطة ميثيل فولات و ب 12 ، وإلى سيستين بواسطة إنزيمات تعتمد على P5P</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
(3015,	1508,	1,	'SOVEREIGN SILVER',	'',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
(3016,	1508,	2,	'الفضة السوفيتي',	'<p>بيع العلامة التجارية الفضية في الولايات المتحدة</p>\r\n\r\n<p>غير معدل وراثيًا - معتمد من NSF</p>\r\n\r\n<p>نباتي</p>\r\n\r\n<p>خالي من الغلوتين</p>\r\n\r\n<p>خالية من مسببات الحساسية</p>\r\n\r\n<p>لماذا الفضة لدعم المناعة للأطفال؟</p>\r\n\r\n<p>نحن نعلم أنه من الصعب جعل الأطفال يتناولون المكملات الغذائية. ألن يكون من الجيد أن يكون لديك منتج مناعي طعمه مثل الماء؟ غالبًا ما يشير العديد من الأطفال إلى Sovereign Silver Kids على أنها مياه سحرية!</p>\r\n\r\n<p>لقد ابتكرنا مكملًا مناعيًا رائع المذاق من أجل النمو الصحي للطفل:</p>\r\n\r\n<p>سريعة وسهلة لاتخاذ</p>\r\n\r\n<p>لا رائحة</p>\r\n\r\n<p>لا طعم</p>\r\n\r\n<p>لا يوجد شكاوى</p>\r\n\r\n<p>سوف يجعل الأطفال الفضيون طفلك سعيدًا بينما يمنحك راحة البال مع العلم أن طفلك يحصل على أفضل دعم مناعي.</p>\r\n\r\n<p>هل كنت تعلم؟</p>\r\n\r\n<p>تم استخدام الفضة لأكثر من 2400 عام للمساعدة في حماية صحة الإنسان. إنه عنصر طبيعي يمكن العثور عليه في الحبوب الكاملة والفطر الصالح للأكل والطبية وحليب الثدييات ومياه الينابيع ومياه البحر ومياه الصنبور.</p>\r\n\r\n<p>&quot;تقنيتنا تصنع أصغر الجسيمات على الإطلاق مع تشتت مثالي تقريبًا ... وتركيز آمن تمامًا يتفوق على منتجات جزء في المليون أعلى بكثير.&quot; - ستيفن كوينتو ، مؤسس</p>\r\n\r\n<p>لماذا هيدروسول الفضة النشط بيولوجيًا؟</p>\r\n\r\n<p>آمن</p>\r\n\r\n<p>ينتج عن حجم الجسيمات الصغير مساحة سطح أكبر وفعالية أعلى.</p>\r\n\r\n<p>تعد 10 جزء في المليون أكثر فعالية من العلامات التجارية المنافسة التي تحتوي على ما يصل إلى 500 جزء في المليون.</p>\r\n\r\n<p>حتى إذا تم تناوله 7 مرات يوميًا لمدة 70 عامًا (بناءً على وزن الجسم) ، فإن Sovereign Silver لا يزال أقل من الجرعة المرجعية للفضة الفموية اليومية (RfD) الخاصة بوكالة حماية البيئة.</p>\r\n\r\n<p>نقي</p>\r\n\r\n<p>الفضة الملكية لها مكونان فقط:</p>\r\n\r\n<p>99.999٪ فضة نقية</p>\r\n\r\n<p>مياه نقية من الدرجة الصيدلانية</p>\r\n\r\n<p>ليس لدينا أملاح أو بروتينات مضافة تجعل منتجات الفضة الأخرى أقل فعالية. يتم تعبئة منتجنا في عبوات زجاجية لا تتسرب ، وليس من البلاستيك.</p>\r\n\r\n<p>فعال</p>\r\n\r\n<p>إذا لم تكن الفضة مشحونة إيجابًا ، فهي ليست نشطة بيولوجيًا. تحتوي الفضة الملكية على أكثر من 98٪ من الفضة النشطة بيولوجيًا ، مما يجعلها أقوى بشكل مضاعف من العلامات التجارية الأخرى التي تحتوي فقط على ما لا يزيد عن 10٪ من الفضة المشحونة إيجابياً. تتميز الفضة الملكية أيضًا بحجم جسيم غير مسبوق يصل إلى 0.8 نانومتر ، مما يسمح للجسم بالامتصاص والقضاء بسهولة.</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
