(3018,	1509,	2,	'الكلوريلا',	'<p>طحالب الكلوريا&nbsp;</p>\r\n\r\n<p>فوائد الكلوريلا</p>\r\n\r\n<p>تتميز الكلوريلا بأنها غنية بالبروتين بنسبة 50-60%، وهي بذلك مصدر فعلي للبروتين</p>\r\n\r\n<p>تعدّ مصدر مميز للحديد وفيتامين ج.</p>\r\n\r\n<p>تحتوي على مضادات الأكسدة.</p>\r\n\r\n<p>تحتوي الكلوريلا على الأوميغا 3.</p>\r\n\r\n<p>توفر كمية كبيرة من الألياف. هنا، من المهم معرفة أن الكلوريلا الخام تحتوي على هذه النسبة العالية من الألياف، أما الحبوب فمحتواها من الألياف أقل بكثير.</p>\r\n\r\n<p>تساعد الكلوريلا على تعزيز وظائف الجهاز المناعي.</p>\r\n\r\n<p>تعزز الكلوريلا صحة عينيك، بفضل محتواها من مضادات الأكسدة</p>\r\n\r\n<p>تحسّن الكلوريلا من عملية الهضم وتقلل من الانتفاخ</p>\r\n\r\n<p>يمكن للكوريلا التخفيف من أعراض متلازمة ما قبل الدورة الشهرية، بفضل محتواها من الكالسيوم وفيتامين ب الذي له دور في التقليل من آلام الدور</p>\r\n\r\n<p>تعزز من صحة الكبد وتطهير الجسم من السموم</p>\r\n\r\n<p>تحتوي الكلوريلا على مجموعة أخرى من الفيتامينات والمعادن؛ كالزنك، المغنيسيوم، البوتاسيوم وغيرها</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
