(3020,	1510,	2,	'سوبر كولون كلين',	'<pre>\r\nاقراص امنة وصحية ومصنوعة من اعشاب طبيعية\r\n\r\n\r\n\r\nالاقراص تساهم ايضا في تنظيف الكبد والقولون والكليتين والدم والقلب\r\n\r\nوالبروستاتا والغدة الكظرية\r\n\r\n\r\n\r\nيساعد في تخفيف الإمساك العرضي\r\nللتطهير الداخلي الخفيف\r\nمكمل غذائي\r\nخالٍ من الجلوتين\r\nجودة وفقًا لممارسات التصنيع الجيدة\r\nمصنوع من الأعشاب والعصيات اللبنية الحمضية\r\nيعزز صحة الجهاز الهضمي\r\nيؤدي إلى انتظام حركة الأمعاء عمومًا في غضون 6 إلى 12 ساعة\r\n</pre>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
