(3026,	1513,	2,	'أشواغاندا',	'<p>&nbsp;فوائد أخرى لعشبة الاشواجندا<br />\r\nزيادة خصوبة الرجل عن طريق رفع مستويات هرمون التستوستيرون لديه<br />\r\nزيادة كتلة العضلات وقوتها<br />\r\nالتقليل من خطر الإصابة بالالتهابات<br />\r\nخفض مستوى الكوليسترول المرتفع والدهون الثلاثية<br />\r\nتعزيز صحة الدماغ والذاكرة<br />\r\nالقدرة على محاربة العدوى سواء من فيروسات أو البكتيريا</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
