(3030,	1515,	2,	'ماستك جام',	'<p>1- رائحة الفم الكريهة<br />\r\n<br />\r\n2- علاج قرحة المعدة<br />\r\n<br />\r\n3- عسر الهضم<br />\r\n<br />\r\n4- داء كرون أو التهاب الأمعاء<br />\r\n<br />\r\n5- آلام المفاصل<br />\r\n<br />\r\n٦-- انخفاض الكوليسترول<br />\r\n<br />\r\n٧-ارتفاع إنزيمات الكبد<br />\r\n<br />\r\n٨-علاج حساسية الصدر<br />\r\n&nbsp;</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
