(3032,	1516,	2,	'ملتي مينيرال',	'<p>ملتي مينيرال له فوائد عديدة و هو أساسي لاكتمال عملية النمو والحفاظ على الصحة، ومنها:<br />\r\nيساعد عنصري الكالسيوم و الماغنسيوم في chelated minerals معادن على الحصول على عظام وأسنان قوية.<br />\r\nيمنع chelated minerals دواء الإصابة بالأنيميا او فقر الدم ويساعد على رفع نسبة الحديد في الدم.<br />\r\nالكالسيوم و الماغنسيوم في chelated minerals يمنعان هشاشة العظام.<br />\r\nيعمل chelated minerals معادن على الوقاية من أمراض القلب، الصداع النصفي.<br />\r\nيوفر ملتي معادن دعم معدني متوازن و يعوض نقص الجسم من المعادن الهامة.<br />\r\nيعمل multi minerals chelated على تقليل حدة التوتر العصبي.<br />\r\nchelated minerals دواء يقلل أعراض ما قبل الحيض مثل التوتر العصبي وآلام الظهر و تقلصات الرحم.<br />\r\nيحتوي علي مضادات الأكسدة القوية التي تعمل على رفع مقاومة الجسم للعديد من الأمراض والسرطانات.<br />\r\nيساعد multi minerals chelated في منع التأخر العقلي، و تحسين وظائف المخ.<br />\r\nيلعب الزنك ايضا دور مهم في تنظيم معدلات سكر الدم,لذا هو مفيد جدا لمرضي السكري.<br />\r\nالأيودين (اليود) في multi minerals chelated هو عنصر هام جدا لصحة الغدة الدرقية.<br />\r\nنقص نسبة الزنك في الجسم يجعل الجسم ضعيف و أكثر قابلية للعدوى، لذا فهو أساسي للوقاية ودعم الجهاز المناعي.<br />\r\nيساعد chelated minerals معادن على منع ضمور خلايا الشبكية والفقد التدريجي للرؤية، و يدعم العصب البصري ويقوي من وظيفته.<br />\r\nيزيد chelated minerals حبوب من جودة و عدد الحيوانات المنوية لدى الرجال.</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
