(3034,	1517,	2,	'سترات المغنيسيوم',	'<p>فوائد سترات المغنيسيوم تكمن الفائدة في سترات المغنيسيوم بمساهمتها على إفراغ الأمعاء والقنوات الهضمية من الفضلات وتطهيرها؛ ويتمّ ذلك بزيادتها لكميات الماء في الأمعاء&nbsp;وتحفيز الجهاز البولي على التغوّط أو التبرز للتخلّص من الفضلات نتيجة الضغط الشديد على الأمعاء؛ ويحدث التبرز بسبب ذلك، وبذلك يعتبر الحلّ الأمثل لحالات الإمساك الشديد، كما تُستخدم كعلاج فعال لبعض حالات التسمّم وفرط الجرعات من الأدوية والعقاقير الطبية.<br />\r\n&nbsp;</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
