(3038,	1519,	2,	'بلاك ماكا',	'<p>1- تحسين صحة الحيوان المنوي<br />\r\nجذور الماكا السوداء والحمراء تأثير معروف على الناحية الجنسية، خاصة للرجال، إذ أن تناول هذه الجذور بانتظام يساعد على زيادة عدد الحيوانات المنوية بالإضافة لتحسين جودة الحيوانات المنوية وصحتها.<br />\r\n<br />\r\nهذه الأمور تساعد على رفع فرص حصول حمل لدى الزوجة، كما تساهم في زيادة ثقة الرجل بنفسه.<br />\r\n<br />\r\n2- تحفيز الرغبة الجنسية<br />\r\nالاستخدام الرئيسي لجذور الماكا والمعروف حول العالم هو تحفيز الرغبة الجنسية، فعند تناول الماكا سواء السوداء او الحمراء فإن هذا يساعد على زيادة الرغبة الجنسية لدى الرجل والمرأة على حد سواء.<br />\r\n<br />\r\nهذه الفائدة تحديداً لنبات الماكا جعلت البعض يسميه فياجرا الطبيعة.<br />\r\n<br />\r\n3- تحسين المزاج<br />\r\nتحتوي الماكا على مضادات أكسدة تعرف بقدرتها على تحسين المزاج وتقليل الأرق وتخفيف الشعور بالاكتئاب الاحساس بضبط المزاج الاتزان النفسي بشكل ملحوظ.<br />\r\n<br />\r\nكما وجدت بعض الدراسات أن الماكا تساعد على تحسين مزاج المرأة بشكل خاص بعد بلوغ سن انقطاع الطمث.<br />\r\n<br />\r\n4- خفض ضغط الدم المرتفع<br />\r\nأحد الفوائد المحتملة للماكا والتي لا زالت قيد البحث والدراسة هو قدرة الماكا على خفض ضغط الدم المرتفع، خاصة عند تناول ما يقارب 3.3 غرام منها يومياً لعدة أسابيع متتالية.<br />\r\n<br />\r\n5- لصحة العظام<br />\r\nإن تضمين الماكا في حميتك الغذائية اليومية قد يساعد بشكل كبير في تحسين صحة العظام وتقويتها وزيادة كثافتها، وفي الوقت ذاته قد تساعد الماكا على مكافحة هشاشة العظام.<br />\r\n<br />\r\nوالسبب في ذلك هو غنى الماكا بالكالسيوم، وهو معدن هام جداً لصحة العظام.<br />\r\n<br />\r\n6- تخفيف أعراض سن اليأس<br />\r\nيساعد تناول المرأة للماكا بانتظام في سن اليأس على تخفيف الأعراض المرافقة لانقطاع الطمث، أي تحسين مزاج المرأة بشكل ملحوظ ورفع مستويات الطاقة لديها.<br />\r\n<br />\r\nلذا، وإذا كانت المرأة تخشى تناول مضادات الاكتئاب لعلاج حالتها النفسية في هذه الفترة العمرية، فإن جذور الماكا قد تكون الحل الطبيعي المناسب.<br />\r\n<br />\r\n7- تحسين المناعة<br />\r\nإن إضافة جذور الماكا إلى حميتك الغذائية اليومية، حتى لو كان ذلك بكميات صغيرة جداً، يساعد على تقوية جهاز المناعة وتحسين دفاعات الجسم.<br />\r\n<br />\r\nإذ تحتوي الماكا على كميات هائلة من البروتينات التي تعتبر ضرورية لإصلاح أي تلف حاصل في أنسجة الجسم وبالتالي تقوية الجسم ومساعدته على مكافحة الأمراض.<br />\r\n<br />\r\n8- حماية البشرة من أشعة الشمس<br />\r\nوجدت بعض الدراسات أن دهن بشرة الوجه بمسحوق جذور الماكا قد يساعد على حماية البشرة من أي ضرر محتمل قد تسببه أشعة الشمس، بما في ذلك الحروق والتجاعيد.<br />\r\n<br />\r\n9- فوائد أخرى<br />\r\nكما أن للماكا فوائد عديدة أخرى، مثل:<br />\r\n<br />\r\nتقليص حجم البروستاتا المتضخمة.<br />\r\nتحسين الذاكرة والقدرات الإدراكية.<br />\r\nعلاج ضعف الانتصاب لدى الرجال.<br />\r\nموازنة مستويات الأستروجين في الجسم.</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
