(3040,	1520,	2,	'الكركم الكركمين',	'<p>مضاد قوي للالتهابات<br />\r\nفقد ثبت أن من الفوائد الصحية للكركم أنه يحتوي على مجموعة كبيرة من المواد المضادة للأكسدة والمواد المضادة للفيروسات وللجراثيم وللفطريات، بالإضافة لاحتوائه على المواد المضادة للالتهابات.<br />\r\n<br />\r\nولهذا يُنصح به كعلاج طبيعي لالتهابات المفاصل، بالإضافة إلى ذلك فهو عامل مطهر ومضاد للجراثيم الطبيعية، ومفيد في تطهير الجروح والحروق وتسريع التئامها، وهو مسكن طبيعي للآلام.<br />\r\n<br />\r\nوبسبب خصائصه المضادة للالتهابات فقد امتلك الفوائد الآتية:<br />\r\n<br />\r\nعلاج الصدفية: قد يُساعد في علاج الصدفية وغيرها من الأمراض الجلدية الالتهابية.<br />\r\nعلاج التهاب المفاصل: يُعد علاج طبيعي لالتهاب المفاصل والتهاب المفاصل الروماتويدي.<br />\r\nعلاج الربو: يمكن أن يُساعد على التقليل من الالتهابات المرتبطة بالربو (Asthma)، ويمكن ذلك عن طريق إضافة ملعقة صغيرة من مسحوق الكركم لكوب من الحليب الدافئ.<br />\r\nمقاومة نزلات البرد والإنفلونزا: باعتباره مادة مضادة للبكتيريا والفيروسات، فهذا يجعله فعالًا في مقاومة السعال الناتج عن نزلات البرد والإنفلونزا.<br />\r\nتحفيز جهاز المناعة: يُساعد على تحفيز جهاز المناعة في الجسم.<br />\r\nالتئام الجروح: يُساعد في التئام الجروح والحروق وإعادة نمو الجلد التالف، ويُمكن استخدامه بوصفه مطهر طبيعي فعال.<br />\r\n2. مكافحة السرطان<br />\r\nدلت العديد من الدراسات الحديثة بأن الكركم يحتوي على الكركمين (Curcumin) وهو العنصر النشط في الكركم، والذي يمكن أن يحفز الخلايا للقيام بالعملية التي تتسبب في التدمير الذاتي للخلايا السرطانية.<br />\r\n<br />\r\nوأكدت الأبحاث أن ملعقة صغيرة من الكركم تساعد فعلًا في الوقاية من العديد من السرطانات، وتدمير الخلايا السرطانية لاحتوائه على مضادات الأكسدة (Antioxidant) القوية.<br />\r\n<br />\r\nوبهذا فقد وجد بأنه قد يساعد في الوقاية من سرطان البروستاتا، وسرطان القولون، وسرطان الثدي، وسرطان الجلد، وهو يقلل من خطر الإصابة بسرطان الدم في مرحلة الطفولة، كما أن له دور في تعزيز فعالية بعض أنواع العلاج الكيميائي والتقليل من آثارها الجانبية.​<br />\r\n<br />\r\n3. مفيد لصحة الكبد ويزيل السموم من الجسم<br />\r\nيعمل الكبد على إزالة سموم الدم من خلال إنتاج الإنزيمات، ويساعد الكركم على زيادة إنتاج هذه الإنزيمات الحيوية مما يؤدي إلى تقليل السموم بفعالية في الجسم.<br />\r\n<br />\r\nكما أثبت بعض الدراسات أن له دور في محاربة أمراض الكبد، وتنشيط وتحسين الدورة الدموية.<br />\r\n<br />\r\n4. خسارة الوزن وحرق الدهون<br />\r\nتتمثل الفوائد الصحية للكركم المتعلقة بخسارة الوزن في ما يأتي:<br />\r\n<br />\r\nأثبتت العديد من التجارب أن من فوائد الكركم أنه يساعد في التمثيل الغذائي للدهون، ويساعد في خسارة الوزن وتنحيف البطن.<br />\r\nيتواجد عنصر في الكركم يساعد على تحفيز المرارة لزيادة إفراز العصارة الصفراء في الجسم، والتي لها الدور الأكبر في هضم الدهون.<br />\r\nيساعد على خفض مستويات سكر الدم، والحد من مقاومة الخلايا للأنسولين المسؤولة عن زيادة تخزين الدهون.<br />\r\nيساعد في تقليل إنتاج الأنسجة الدهنية من خلال زيادة الأوعية الدموية.<br />\r\nيمكنه تحفيز الجسم لحرق الدهون في العمليات الخاصة بالمحافظة على درجة حرارة الجسم.<br />\r\nيحسن من عملية الهضم، ويقلل من أعراض الانتفاخ (Bloating) والغازات.<br />\r\nيُعد الكركم مفيد في علاج معظم أشكال التهابات الأمعاء، بما في ذلك التهاب القولون التقرحي.<br />\r\n5. محاربة الزهايمر<br />\r\nلقد أثبتت الأبحاث دور كبير للكركم في منع أو إبطاء تطور مرض الزهايمر عن طريق إزالة الترسبات (plaques) الناتجة عن تراكم بروتين البيتا أميلويد بين خلايا الدماغ التي تسبب الزهايمر.<br />\r\n<br />\r\nولطالما تم ربط مرض الزهايمر أيضًا بإصابة الدماغ بالالتهاب، ومن المعروف أن الكركم له الخصائص المضادة للالتهابات والنشاط المضاد للأكسدة، لذلك فإن الاستهلاك اليومي المنتظم للكركم قد يكون وسيلة فعالة لمنع ظهور مرض الزهايمر وتحسين الذاكرة.<br />\r\n<br />\r\nومن فوائد الكركم أيضًا أنه يدعم صحة الدماغ بشكل عام عن طريق المساعدة في إزالة تراكم المواد الدهنية في الدماغ وتحسين تدفق الأكسجين إليه.<br />\r\n<br />\r\n6. السيطرة على مرض السكري<br />\r\nلقد أظهرت العديد من الدراسات أن المواد المضادة للأكسدة في الكركم تساعد وبفاعلية على تقليل مقاومة الأنسولين، مما قد يكون له دور في منع حدوث مرض السكري من النوع الثاني.<br />\r\n<br />\r\nكما أنه له دور في تحسين السيطرة على مستويات الغلوكوز، ويزيد من تأثير الأدوية المستخدمة في علاج مرض السكري.<br />\r\n<br />\r\nولكن يجدر الانتباه إلى أن تأثيره العكسي قد يكون خطرًا على مرضى السكري عندما يقترن تناوله مع أخذ أدوية السكري القوية، مما قد يؤدي لانخفاض نسبة السكر المفاجئ في الدم، لهذا فمن الأفضل استشارة الاخصائي قبل أخذ كبسولات الكركم.<br />\r\n<br />\r\n7. تقليل مستوى الكولسترول في الدم<br />\r\nلقد أثبتت الأبحاث أن مجرد استخدام الكركم باعتبارها توابل طعام يمكن أن يقلل من مستويات الكولسترول في الدم، فمن المعروف أن ارتفاع الكوليسترول في الدم يمكن أن يؤدي إلى مشكلات صحية خطيرة أخرى، فهو يُسهم في منع العديد من الأمراض القلبية وأمراض الأوعية الدموية.<br />\r\n<br />\r\nويمكنك إضافة الكركم على شكل مسحوق للعديد من الأطباق المقلية كالبيض والعصائر والحليب الدافئ، أو قد يستخدم لإعطاء الصبغة واللون مثلًا عند إضافته للأرز، أو يمكن أن يؤخذ الكركم على شكل حبوب يمكن شرائها من الصيدليات.<br />\r\n<br />\r\n8. فوائد الكركم للوجه والجمال والبشرة<br />\r\nوجد أن للكركمين خصائص تساعد على تعزيز صحة البشرة وجمالها، وتقوي الشعر وتعالج مشاكله، ولعل أقوى النتائج ظهرت على موضوع علاج حب الشباب وآثاره، وتنقية البشرة وتوحيد لونها.</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
