(3042,	1521,	2,	'السيليكا',	'<p>محاربة التجاعيد وشد الوجه وبالتالي الحصول على بشرة شابة<br />\r\nمنح البشرة الليونة وامتصاص الرطوبة<br />\r\nتعزيز لمعان ونضارة الجلد<br />\r\nالتخفيف من آثار حب الشباب والبثور<br />\r\nتوازن إفراز الزيوت في البشرة<br />\r\nمعالجة الندبات والتصبغات<br />\r\nمنع تكسّر الأظافر وحمايتها من الإصفرار<br />\r\nفوائد السيليكا للشعر<br />\r\n<br />\r\nمحاربة تساقط الشعر وتقصّفه<br />\r\nتقوية البصيلات في فروة الرأس وزيادة نمو الشعر<br />\r\nترطيب الشعر ومحاربة الجفاف<br />\r\nتأخير شيب الخصلات في عمر مبكر<br />\r\nما هي فوائد السيليكا الصحيّة؟<br />\r\nإلى جانب منافع الـsilica الجمالية، يحمل هذا المعدن فوائد صحية على الجسم، من بينها:<br />\r\n<br />\r\nتعزيز إنتاج المعادن المسؤولة عن تقوية العظام وحمايتها من التكسّر<br />\r\nزيادة مرونة المفاصل<br />\r\nتخفيف إحتمال الإصابة بأمراض القلب والشرايين<br />\r\nتفعيل الجهاز المناعي<br />\r\nمساعدة الخلايا على إنتاج بروتينات أساسية في الجسم<br />\r\nتفعيل وظيفة الذاكرة ومحاربة الألزهايمر</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
