(3052,	1526,	2,	'بذور الكرفس الحامضة',	'<p>مقتطفات من بذور الكرز والكرفس يعتقد أنها فعالة ضد النقرس وأكثر<br />\r\nيتميز نوبة النقرس بألم هائل يمكن أن يضعف لأنه يمنع الناس من المشي وأداء مهامهم المعتادة. النقرس هو نوع من التهاب المفاصل الذي يؤثر على المفاصل في كلتا اليدين والقدمين. يحدث ذلك بسبب وجود تراكم حمض اليوريك في المفاصل خاصةً إصبع القدم الكبير. بعض أنواع الأطعمة التي تحتوي على كميات كبيرة من البيورينات يمكن أن تزيد من تراكم حمض اليوريك في الجسم مما يؤدي إلى النقرس. في حين أنه من الضروري التوقف عن تناول الأطعمة الغنية بالبورين ، من المهم أيضًا استكشاف العلاجات الطبيعية لعلاج النقرس.<br />\r\n<br />\r\nقد تساعد في تقليل الألم الناجم عن النقرس<br />\r\nقد تساعد في معالجة الظروف الصحية الأخرى<br />\r\nيحتوي على مضادات الأكسدة القوية بما في ذلك الأنثوسيانين وحمض الإيلاجيك<br />\r\nشاشة خضراء لضمان أن المكونات خالية من الشوائب<br />\r\nيحتوي على 500 ملليغرام من مقتطفات الكرز اللاذع<br />\r\n120 ملليغرام من مستخلصات بذور الكرفس<br />\r\nجرعة واحدة (1) كبسولة يوميا</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
