(3056,	1528,	2,	'سينتروم مينيس',	'<p>سنتروم مينيومات البالغين 50+ مكملات الفيتامينات هو ملحق يوميا شخصية للبالغين الذين تتراوح أعمارهم بين 50+. يضم أقراص أصغر بنسبة 50٪ من البالغين السنتروم العادية، السنتروم مينيس الكبار أيضا طلاء سلس أن يجعل من السهل ابتلاع أقراص. تتكون من الفيتامينات والمعادن الرئيسية، وهذه المكملات الغذائية اليومية دعم الجسم كله: فيتامينات ب والليكوبين تساعد على تعزيز صحة القلب3؛ الزنك وفيتامينات ب تساعد على دعم وظيفة الدماغ العادية؛ والفيتامينات أ، ج، ه و لوتين + تساعد على دعم عيون صحية. غير غومو والغلوتين خالية، السنتروم مينيوم البالغين 50 + ملحق الفيتامينات يحتوي على أي المحليات الاصطناعية أو النكهات الاصطناعية. ، النساء، والأطفال في جميع أنحاء العالم لسنوات، السنين، السنتروم هو #1 الطبيب والصيدلي أوصت العلامة التجارية متعددة الفيتامينات1. ضمان رضا إذا لأي سبب من الأسباب كنت غير راض عن أي منتج الرعاية الصحية الاستهلاكية GSK، GSK الرعاية الصحية للمستهلك سوف توفر لك مع السداد في غضون 45 يوما من تاريخ الشراء. يرجى ملاحظة أنه نظراً لأن GSK غير قادر على التحكم في جودة منتجاتنا التي تباع من قبل البائعين غير المصرح به، فإن الضمان غير متوفر للمنتجات التي تم شراؤها من البائعين غير المصرح لهم بسبب مشكلات الجودة المحتملة خارج نطاق تحكم GSK. يرجى الاتصال GSK الرعاية الصحية للمستهلك مباشرة لمزيد من المعلومات.</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
