(3068,	1534,	2,	'الجنكة بيلوبا',	'<p>1. تحسين الصحة العقلية<br />\r\nهناك بعض الدلائل التي ما زالت قيد الدراسة حول أهمية الجينكو بيلوبا في تحسين الصحة العقلية عن طريق الحفاظ على الذاكرة، والتحسين من أداء المهام اليومية والتصرفات الاجتماعية.<br />\r\n<br />\r\nهناك دراسات عديدة ذات نتائج متضاربة حول فائدة الجينكو بيلوبا للصحة العقلية، فقد أوجدت دراسة علمية أن أحد مستخلصات الجينكو بيلوبا يفيد في علاج الزهايمر والخرف، لكن لم يتم التوصل إلى نتيجة ثابتة حول الجينكو بيلوبا وهذه الأمراض العصبية.<br />\r\n<br />\r\n2. التخفيف من القلق<br />\r\nإن تناول مستخلصات الجينكو بيلوبا قد يساعد في التخفيف من التوتر ومشاكل اضطراب المزاج، فهو يقلل من الأعراض المصاحبة لنوبات القلق.<br />\r\n<br />\r\nلكن في حال تناول دواء ألبرازولام (Alprazolam) لا يجب تناول أيًا من مستخلصات الجينكو بيلوبا؛ لأنها قد تقلل من فعالية الدواء.<br />\r\n<br />\r\n3. علاج بعض أمراض العين<br />\r\nقد يفيد تناول مستخلصات الجينكو بيلوبا في علاج بعض أمراض العين، مثل: المياه الزرقاء، فهي تحتوي على مضادات الأكسدة التي تحسن من تدفق الدم مما يقلل من تدهور صحة الشبكية.<br />\r\n<br />\r\nإن إحدى الدراسات وضحت فائدة الجينكو بيلوبا في الحفاظ على النظر لمدة أطول عند مرضى التنكس البقعي، كما توضح فائدة الجينكو بيلوبا في تحسين الرؤية الملونة عند مرضى السكري الذين يعانون من اعتلال الشبكية.<br />\r\n<br />\r\n4. علاج مشكلات تدفق الدم<br />\r\nإن تناول مستخلصات الجينكو بيلوبا قد تفيد في علاج بعض الأمراض المتعلقة بمشكلات تدفق الدم، مثل: التهاب الوريد الخثاري، وظاهرة رينو، وأمراض الشرايين المحيطة.<br />\r\n<br />\r\n5. فوائد أخرى<br />\r\nتشمل فوائد الجينكو بيلوبا المحتملة ما يأتي:<br />\r\n<br />\r\nعلاج ارتفاع ضغط الدم.<br />\r\nعلاج مقاومة الإنسولين.<br />\r\nعلاج خلل الانتصاب.<br />\r\nعلاج طنين الأذن.<br />\r\nعلاج التصلب اللويحي</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
