(3072,	1536,	2,	'البروبيوتيك',	'<p>البروبيوتيك مفيدة للجهاز الهضمي، فهي تعمل على التوازن بين البكتيريا الضارة والبكتيريا النافعة، وبالتالي تنظيم أداء الجهاز الهضمي، والحفاظ على أداء وظيفته بشكل سليم، والحفاظ على صحة الأمعاء.<br />\r\nتعمل على الحماية من الأمراض والعدوى، حيث تقوي الجهاز المناعي، وتقي من الأمراض المختلفة واضطرابات المناعة الذاتية مثل التهاب المفاصل الروماتويدي، والتهاب القولون التقرحي والالتهابات المهبلية، والالتهابات الجلدية وغيرها.<br />\r\nالتخفيف من متلازمة القولون العصبي.<br />\r\nعلاج التهابات الأمعاء.<br />\r\nعلاج الإسهال الناجم عن الطفيليات، والبكتيريا الضارة، والفيروسات.<br />\r\nتساعد على التخفيف من الحساسية، وعلاج نزلات البرد</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
