(3074,	1537,	2,	'صمغ الأظافر والبشرة',	'<p>فيتامينات hair skin nails&nbsp;تمنحك فى قطع صغيرة بطعم نكهة الفراولة الرائعة&nbsp;افضل حبوب فيتامين للشعر والبشره والاظافر&nbsp;ليعطيك جسمك ما يحتاجه من العناصر الغذائية للمحافظة على جمالك وتألقك</p>\r\n\r\n<p>فيتامينات hair skin nails&nbsp;تعد من افضل انواع الملتي فيتامين للنساء لتدعيم صحة وجمال الشعر إلى جانب الأظافر وأيضا للمحافظة على صحة البشرة وجمالها مع مساهمتها أيضا للجسم فى إمدادها بالطاقة وغير ذلك من الفوائد، كما أنhair skin nails&nbsp;مصنوعة من أنقى المكونات مثل البيوتين المتواجد بحضور قوى مع فيتامين E و C المضادين للأكسدة بمذاق طعم الفراولة اللذيذ لتدعيم صحة المرأة وجمالها والمحافظة على زهوتها.</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
