(3076,	1538,	2,	'أسيتيل إل كارنيتين',	'<p>أسيتيل إل كارنيتين (ALC ، ALCAR) - شكل أسيتيل من الكارنيتين الشبيه بالفيتامينات. لها خصائص التمثيل الغذائي ومضادات الأكسدة والوقاية العصبية. يستخدم Acetyl-L-Carnitine في علاج حالات الإجهاد العميق والاكتئاب. يؤدي تناول ALC إلى زيادة حساسية الأنسولين في الأنسجة وتكثيف الأحماض الدهنية طويلة السلسلة في إنتاج الطاقة وإنفاقها ، وهذا له تأثير إيجابي على زيادة التأثيرات الأيضية وتحسين الجماليات وتكوين الجسم يستخدم ALC أيضًا في الوقاية من العقم عند الذكور وعلاجه. يوصى باستخدام مكملات ALC لمن هم نشيطون بدنيًا وعقليًا ومجهدين ومكتئبين يقلل من الشعور بالإرهاق وإدراكه. يساعد في عملية تقليل دهون الجسم ..</p>\r\n\r\n<p>&nbsp;</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
