(3078,	1539,	2,	'بيتين هيدروكلورايد البيبسين',	'<pre>\r\nيقدم Nutricost&#39;s Betaine HCl + Pepsin حجم خدمة مثالي من Betaine HCl بالإضافة إلى Pepsin لتحقيق أقصى قدر من الامتصاص. تم تصميم Nutricost&#39;s Betaine HCl + Pepsin لتوفير أقصى دعم للجهاز الهضمي.</pre>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
