(3080,	1540,	2,	'مستخلص شوك الحليب',	'<p>له فوائد صحية لحالات الكبد المختلفة مثل ؛ تليف الكبد والتهاب الكبد الكحولي والكبد الدهني الكحولي والتسمم الكبدي و التهاب الكبد الفيروسي<br />\r\nالسكري : قد يخفض نسبة السكر في الدم لدى مرضى السكري من النوع الثاني.<br />\r\nعسر الهضم :قد يحسن أعراض عسر الهضم عند اخذه من المكملات الغذائية</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
