(3082,	1541,	2,	'ويل مان اوريجينال',	'<p>ويلمان&nbsp;هو مكمل غذائي يحتوي على&nbsp;فيتامينات ومعادن متعددة&nbsp;تحافظ على الصحة وتدعم وظائف الجسم. يزود ويلمان جسم الرجل&nbsp;بالعناصر الضرورية&nbsp;لصحة الجسم، إذ يساعد فيتامين د على دعم وظائف جهاز المناعة، بينما تساعد فيتامينات ب 1 و ب 6 على إطلاق الطاقة وزيادة النشاط.</p>\r\n\r\n<p>تحافظ فيتامينات ب 12 و ب 2 على صحة خلايا الدم الحمراء، ويحافظ الزنك على&nbsp;مستويات التستوستيرون، ويقلل الحديد والنحاس من الشعور بالتعب بدعم وظائف خلايا الدم.</p>',	NULL,	0,	NULL,	0,	0,	NULL,	0,	0),
