(3084,	1542,	2,	'ويل مان  +50',	'<p>wellman 50&nbsp;&nbsp;يعتبر من&nbsp; أفضل المكملات الغذائية للرجال الذين تزيد أعمارهم عن 50 عامًا.تحتوى اقراص ويلمان ،على كل ما يحتاجه جسم الرجل لدعم الصحة والمناعة كي يتمكن من مواصلة أدائه اليومي بشكل طبيعي ، النشاط وعدم الاصابة&nbsp; بالإجهاد والتعب.&nbsp;يحتوي&nbsp; على مجموعة واسعة من العناصر الغذائية الرئيسية لدعم القلب والدماغ والعينين، فمع تقدم الرجال في العمر، يصبح من المهم الحصول على كميات كافية من المغنيسيوم والزنك إلى جانب الفيتامينات D و E وغيرها الكثير، كما يحتوى&nbsp;wellman 50&nbsp;على العديد من العناصر الاساسية للجسم ولذلك يعمل المكمل الغذائي ويلمان حبوب للرجال&nbsp;كعامل أساسي ضروري في الحفاظ على صحة العضلات وكذلك القلب والدماغ.</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
