(3088,	1544,	2,	'بينك البسموث',	'<h1>يستخدم في علاج بعض حالات الاسهال و في الوقاية ضد الاصابة باسهال المسافرين و يستخدم في علاج قرحة الأثني عشر النشطة أو الملتئمة (يستخدم مع عدد من العلاجات الأخرى للتخلص من جرثومة المعدة أو البكتيريا الملوية الوابية).</h1>',	NULL,	0,	NULL,	0,	0,	NULL,	0,	0),
