(3090,	1545,	2,	'ب كومبلكس',	'<h1>vitamin b complex هو مكمل غذائي عبارة عن مزيج من انواع فيتامين ب الـ 8 الأساسيين، المهمين في انتاج الطاقة في الجسم، والمهمة أيضا لصحة الجهاز العصبي، وصحة القلب، وإنتاج خلايا الدم، كما أنه معزز بفيتامين c لدعم مضادات الاكسدة،التي تساعد في تقوية جهاز المناعة في الجسم.</h1>\r\n\r\n<p>&nbsp;</p>',	NULL,	0,	NULL,	0,	0,	NULL,	0,	0),
