(3102,	1551,	2,	'عشبة الزعرور',	'<p>فوائد عشبة الزعرور</p>\r\n\r\n<p>هناك الكثير من الأعشاب التي تساهم بشكل كبير في علاج بعض الأمراض، ومنها عشبة الزعرور التي تمتلك فوائد هائلة بسب احتوائها على عناصر صحية قيمة.</p>\r\n\r\n<p>إليك أهم فوائد عشبة الزعرور الصحية في ما يأتي:</p>\r\n\r\n<p>تساهم في علاج أمراض القلب والأوعية الدموية</p>\r\n\r\n<p>تستخدم عشبة الزعرور في المساعدة على علاج أمراض القلب والأوعية الدموية، مثل: قصور القلب الاحتقاني (CHF)، وعدم انتظام ضربات القلب.</p>\r\n\r\n<p>كما يمكن أن تساعد عشبة الزعرور في تحسين كمية الدم التي يتم ضخها خارج القلب أثناء التقلصات، وتوسيع الأوعية الدموية، وزيادة انتقال الإشارات العصبية، لذلك تعد ذو أثر فعال في علاج ارتفاع ضغط الدم.</p>\r\n\r\n<p>تحسن الجهاز الهضمي</p>\r\n\r\n<p>من فوائد عشبة الزعروز قدرتها علة المساعدة في عملية الهضم، وذلك بسبب احتوائها على نسب جيدة من الألياف الغذائية.</p>\r\n\r\n<p>لم يتوقف الأمر على ذلك بل وجد أن لعشبة الزعرور قدرة في علاج أوجاع وأمراض الجهاز الهضمي، مثل: عسر الهضم، والإسهال، والام المعدة.</p>\r\n\r\n<p>تدخل في علاج الأمراض الجلدية</p>\r\n\r\n<p>تتميز عشبة الزعرور بمحتواها العالي من مضادات الأكسدة، والتي غالبًا تساعد في علاج الالتهابات وتخفيفها، هذه الميزة جعلت لعشبة الزعرور دور فعال في علاج بعض المشكلات الجلدية، مثل: الدمامل، والقروح، والحكة.</p>\r\n\r\n<p>إن استخدام عشبة الزعرور لعلاج المشكلات الجلدية يتم بتطبيق معجون العشبة على مكان التقرح أو الالتهاب.</p>\r\n\r\n<p>تقلل من الكوليسترول والدهون</p>\r\n\r\n<p>وجد أن من فوائد عشبة الزعرور قدرتها على خفض الكوليسترول، والبروتين الدهني منخفض الكثافة، والدهون الثلاثية، مما قد يؤدي إلى تقليل تراكم الدهون في الكبد، والشريان الأورطي.</p>\r\n\r\n<p>إن مستخلص عشبة الزعرور يخفض الكولسترول عن طريق زيادة إفراز الصفراء، مما يقلل من تكوين الكوليسترول، ويعزز من نشاط مضادات للأكسدة.</p>\r\n\r\n<p>تؤثر إيجابًا على الحالة النفسية</p>\r\n\r\n<p>وجد أن لعشبة الزعرور دور مساعد في تخفيف القلق، وتحسين الحالة النفسية، لذلك يمكن شرب شاي عشبة الزعرور عند الشعور بالتوتر والإحباط.</p>\r\n\r\n<p>تعزز صحة الشعر</p>\r\n\r\n<p>من فوائد عشبة الزعرور التي تعد جمالية أنها تعزز صحة الشعر، فتطبيق منقوعها على الشعر يقلل من تساقطه، ويزيد من حج البصيلات.</p>\r\n\r\n<p>قد اعتقد الباحثون أن سبب الفائدة هذه يعود إلى احتواء عشبة الزعرور على مركب البوليفينول (Polyphenol)، والذي له دور فعال في تحسين صحة الشعر</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
