(3104,	1552,	2,	'المورينجا جرين سوبرفوود',	'<p>فوائد المورينجا</p>\r\n\r\n<p>تحتوي المورينجا على العديد من العناصر الغذائية المهمة للجسم، الأمر الذي ينعكس إيجابًا على الصحة، إليك أهم فوائد المورينجا الاتية:</p>\r\n\r\n<p>الوقاية من الإصابة بالسرطان</p>\r\n\r\n<p>تحتوي أوراق وجذور وبذور شجرة المورينجا على مضادات الأكسدة (Antioxidant)، مثل: فلافونيدات، وبوليفينول، وحامض الأسكوربيك (Ascorbic acid)، حيث أن مضادات الأكسدة تحارب الجذور الحرة، مما قد يقي الجسم من الإصابة بالسرطانات.</p>\r\n\r\n<p>وتعرف الجذور الحرة بأنها جزيئات تؤدي إلى تلف الخلايا، وتتسبب شيخوختها وإصابتها بأمراض مزمنة، مثل: السرطانات.</p>\r\n\r\n<p>المساهمة في علاج الالتهابات</p>\r\n\r\n<p>تتمثل فوائد المورينجا أيضًا بخصائصها المضادة للالتهابات، حيث أن أوراقها قادرة على تثبيط الإنزيمات والبروتينات المسببة للالتهابات في الجسم، فتعمل بذلك على معالجة الالتهابات والوقاية منها.</p>\r\n\r\n<p>كما أن الالتهابات المتكررة من شأنها أن تتطور أحيانًا إلى أمراض مزمنة، مثل: السكري (Diabetes)، وأمراض القلب، والتهابات المفاصل المستمرة، وبالتالي فإن أوراق شجرة المورينجا قد تساعد في الوقاية من هذه الأمراض.</p>\r\n\r\n<p>تخفيض مستوى السكر في الدم</p>\r\n\r\n<p>أظهرت إحدى الدراسات التي اشتملت على 30 امرأة أن تناول 7 غرام يوميًا من مسحوق أوراق المورينجا طيلة ثلاثة أشهر أدى إلى خفض مستوى سكر الدم لديهن بمعدل 13.5% .</p>\r\n\r\n<p>بينما عكست دراسة مصغرة اقتصرت على 6 أشخاص مرضى بالسكري أن إضافة 50 غرامًا من أوراق المورينجا إلى نظامهم الغذائي خفضت نسبة سكر الدم بـ21%.</p>\r\n\r\n<p>تخفيض مستويات الكوليسترول، وحماية القلب</p>\r\n\r\n<p>ارتفاع مستوى الكولسترول يزيد من خطر الإصابة بأمراض القلب المزمنة، ولحسن الحظ فهناك العديد من الأطعمة النباتية التي من شأنها أن تساهم في خفض مستوى الكولسترول بشكل فعال، منها بذور الكتان، والشوفان بالإضافة إلى اللوز وأوراق المورينجا.</p>\r\n\r\n<p>حيث أن أوراق المورينجا تحتوي على خصائص تجعلها محاربة للكوليسترول وداعمة في تخفيضه، وبالتالي وقاية القلب من الأمراض.</p>\r\n\r\n<p>حماية وتغذية البشرة والشعر</p>\r\n\r\n<p>يساهم زيت بذور المورينجا في تغذية الشعر والبشرة ويزيد من ترطيبهما، كما وجد أن للزيت قدرة على المساعدة في معالجة قروح الجلد.</p>\r\n\r\n<p>المساهمة في المحافظة على صحة الدماغ</p>\r\n\r\n<p>تساهم أجزاء شجرة المورينجا في دعم صحة الدماغ، والقدرة الإدراكية المعرفية بفعل نشاطتها المضادة للأكسدة، وتساهم المورينجا أيضًا في ما يأتي:</p>\r\n\r\n<p>مقاومة مرض الزهايمر.</p>\r\n\r\n<p>مقاومة تنكس الخلايا العصبية، بسبب احتواء أوراق المورينجا على نسب عالية من الفيتامينات.</p>\r\n\r\n<p>تحسين وظائف الدماغ.</p>\r\n\r\n<p>تحسين إفراز النواقل العصبية، مثل: السيروتونين، والدوبامين، والنورأدرينالين، مؤديًا بذلك إلى تحسين الذاكرة والمزاج.</p>\r\n\r\n<p>محاربة القلق والاكتئاب والذهان.</p>\r\n\r\n<p>&nbsp;</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
