(3110,	1555,	2,	'السبيرولينا',	'<p>فوائد السبيرولينا</p>\r\n\r\n<p>تتحلى السبيرولينا بمزايا عديدة جدًا جعلتها من المكملات الغذائية المهمة الموجودة في الأسواق، حيث لها أدوار محتملة للعديد من الفوائد، نذكر أبرز فوائد السبيرولينا في ما يأتي:</p>\r\n\r\n<p>مقاومة السرطان</p>\r\n\r\n<p>من الممكن أن يسبب الالتهاب المزمن العديد من الأمراض ومنها السرطان.</p>\r\n\r\n<p>وكون السبيرولينا تحتوي على مضادات الأكسدة التي تحارب الالتهاب المزمن، فقد يكون للسبيرولينا تأثير مضاد أو وقائي للسرطان خاصة بسبب احتوائها على مادة فيكوسيانين (Phycocyanin)، والذي يعد من أهم مكونات السبيرولينا المسؤولة عن خصائصها المضادة للأكسدة والمانعة لنمو الأورام وحتى القضاء عليها.</p>\r\n\r\n<p>أما فيما يخص سرطان الفم تحديدًا، فقد أجريت إحدى الدراسات على 87 شخصًا مصابًا بمجموعة من التليفات المخاطية والتي تعد افات سرطانية، فظهر في الدراسة أنه بعد استخدام 1 غرام يوميًا لمدة سنة قلت افات الفم بنسبة 45% لدى المصابين، بينما عادت لتنمو وتتطور مباشرة بعد التوقف عن تناولها، ولكن لم تثبت فعالية نتائج هذه الدراسة إلى الان.</p>\r\n\r\n<p>الوقاية من أمراض القلب</p>\r\n\r\n<p>تشير العديد من الدراسات لدور السبيرولينا في خفض مستوى الكولسترول الضار (LDL) والكلي في الدم، بينما ترفع من مستوى الكولسترول الجيد (HDL)، إضافة إلى تقليل مستويات الدهون الثلاثية، ما يعمل على تقليل فرصة حدوث الجلطات وأمراض القلب المرتبطة بارتفاع الدهون في الدم.</p>\r\n\r\n<p>ونتج في إحدى الدراسات أن تناول 1 غرام يوميًا من سبيرولينا أدى إلى انخفاض الدهون الثلاثية بنسبة 16.3% والكولسترول الضار بنسبة 10.1%، كما أكدت العديد من الدراسات الأخرى على هذ التأثير للسبيرولينا لكن بجرعات أكبر تصل حتى 8 غرام في اليوم الواحد.</p>\r\n\r\n<p>إضافة إلى ذلك وجد أن البروتينات الموجودة في السبيرولينا تحفز إنتاج أكسيد النتيريك، الذي يعمل على ارتخاء جدران الأوعية الدموية وبالتالي الحفاظ على ضغط الدم من الارتفاع.</p>\r\n\r\n<p>تقليل أعراض التهاب الأنف التحسسي</p>\r\n\r\n<p>تبين في إحدى الدراسات التي أجريت على أشخاص مصابين بالتهاب الأنف التحسسي قدرة السبيرولينا على التخفيف من بعض الأعراض المصاحبة لالـتهاب الأنف التحسسي، مثل: إفرازات واحتقان الأنف، والعطس والحكة لدرجة كبيرة، والتي تنتج عن مسببات الحساسية، مثل: حبوب اللقاح، وشعر الحيوانات، وغبار القمح، ما قد يجعلها بديل محتمل لعلاج أعراض تحسس الأنف.</p>\r\n\r\n<p>تنظيم مستويات سكر الدم</p>\r\n\r\n<p>أظهرت بعض الدراسات التي أجريت على الحيوانات أن السبيرولينا من شأنها أن تخفض من مستويات السكر في الدم بشكل ملحوظ.</p>\r\n\r\n<p>وفي دراسة أخرى أجريت على البشر وشملت 25 مريضًا مصابًا بالسكري من النوع الثاني أدى تناول 2 غرام من السبيرولينا يوميًا لخفض مستوى سكر الدم إلى درجة تقلل خطر الوفاة بسببه بنسبة 21%، إلا أنه في الواقع دامت هذه الدراسة لمدة شهرين ونصف فقط، ما يشير إلى حاجة إعادة فحص العلاقة بين سبيرولينا وسكر الدم بشكل أكثر عمقًا.</p>\r\n\r\n<p>ويجدر التنويه إلى ضرورة عدم أخذ مرضى السكري لمكملات السبيرولينا قبل استشارة الطبيب.</p>\r\n\r\n<p>علاج فقر الدم</p>\r\n\r\n<p>يتميز أكثر أنواع فقر الدم شيوعًا بانخفاض الهيموغلوبين أو خلايا الدم الحمراء في الدم، وهو أمر يتعلق أيضًا بنقص الحديد في الجسم.</p>\r\n\r\n<p>في دراسة أجريت على 40 شخصًا من كبار السن ولديهم تاريخ من فقر الدم، زادت مكملات السبيرولينا من محتوى الهيموغلوبين في خلايا الدم الحمراء كما تحسن عمل جهاز المناعة، ومع ذلك لم تجرى العديد من الدراسات في هذا الخصوص ما يعني وجود حاجة لدراسات على مستوى أكبر لفهم التأثير بشكل أدق.</p>\r\n\r\n<p>دعم الجهاز المناعي</p>\r\n\r\n<p>بسبب محتواها العالي من مضادات الأكسدة، والفيتامينات، والعناصر الأساسية قد يكون للسبيرولينا دور في الحفاظ على صحة الجهاز المناعي، وتحفيز إنتاج خلايا الدم البيضاء والأجسام المضادة، ما قد يكون له دور في تعزيز عمل الجهاز المناعي في محاربة بعض أنواع الفيروسات، مثل: الإنفلونزا، ولكن ما زال هذا الإدعاء قيد الدراسة.</p>\r\n\r\n<p>تعزيز إعادة بناء العضلات</p>\r\n\r\n<p>نتج عن بعض الدراسات أن سبيرولينا قد تكون من ضمن الأطعمة التي ترفع من قدرة العضلات على تحمل ضرر تأكسد خلايا العضلات والتقليل منها، ولكن لا تزال هناك حاجة لإثبات ذلك على نحو أدق.</p>',	NULL,	0,	'',	NULL,	NULL,	'',	NULL,	NULL),
